	(1481, 'pl', 'Meble do restauracji i hoteli', '', ''),
	(1480, 'en', 'Footer', '', ''),
	(1480, 'pl', 'Stopka', 'Standardy naszej pracy wyznaczają: kompletność, wysoka jakość oraz prestiż. Kompletność polega na całościowej propozycji artykułów meblarskich. Nasza oferta to: meble wypoczynkowe skórzane, meble tapicerowane, stoły, krzesła, kanapy, ekskluzywne meble włoskie i stylowe melbe. Nasze produkty dobieramy w taki sposób aby ich jakość była zawsze spójna z najwyższymi standardami użytkowania. Prestiż naszej propozycji opiera się na współpracy jedynie z uznanymi producentami mebli. Obecnie w naszej ofercie: ekskluzywne melbe włoskie, meble wypoczynkowe skórzane, meble tapicerowane skórzane, krzesła, stoły i kanapy pochodzą od powszechnie cenionych producentów z kraju i zza granicy. Pozostaje zaprosić Państwa do naszych salonów. Czekamy na Państwa.', 'Standardy, naszej, wyznaczają:, kompletność, wysoka, jakość, prestiż, Kompletność, polega, całościowej, propozycji, artykułów, meblarskich, oferta, wypoczynkowe, skórzane, tapicerowane, stoły, krzesła, kanapy, ekskluzywne, włoskie, stylowe, produkty, dobieramy, sposób, jakość, zawsze, spójna, najwyższymi, standardami, użytkowania, Prestiż, naszej, propozycji, opiera, współpracy, jedynie, uznanymi, producentami, Obecnie, naszej, ofercie:, ekskluzywne, włoskie, wypoczynkowe, skórzane, tapicerowane, skórzane, krzesła, stoły, kanapy, pochodzą, powszechnie, cenionych, producentów, granicy, Pozostaje, zaprosić, Państwa, naszych, salonów, Czekamy, Państwa'),
	(1476, 'pl', 'Meble do restauracji i hoteli', '', ''),
	(1464, 'pl', 'Nasze realizacje', '', ''),
	(1502, 'pl', 'O nas', 'Zapraszamy  w niezwykłą podróż po królestwie światła...W naszej kolekcji znajdziecie Państwo zjawiskowe lampy, które odmienią wnętrze, nadając mu ponadczasowy charakter.  Lampy, dzięki którym po zachodzie słońca, przestrzeń nadal emanuje subtelnym ciepłem, gdzie gra światła i cienia hipnotyzuje i urzeka.Niepowtarzalny wygląd naszej kolekcji czaruje rzeczywistość, a limity wyznacza jedynie wyobraźnia kreatorów.Lampy, które proponujemy,  uwodzą oryginalnym wzornictwem i niezwykłą lekkością. Stanowią subtelną biżuterię dla wnętrza-  intrygują i przyciągają wzrok. Stworzone z wykorzystaniem najwyższej jakości materiałów, są jednocześnie eleganckie i funkcjonalne. Doskonałe dla podkreślenia walorów wybranej przestrzeni, w odpowiedniej aranżacji stanowią stylową dekorację, dyskretnie budując nastrój. Z gry światłem uczyniliśmy sztukę, ubierając je w najprzeróżniejsze formy i kształty. Od nowoczesnych, poprzez klasyczne, czasem żartobliwe czy szalone, nasze lampy odrealnią domową przestrzeń i dodadzą jej lekkości.Dodatkowo, ekskluzywna kolekcja lamp ogrodowych, rozświetli letnie wieczory. Zaprosi do wyjścia na zewnątrz, do wsłuchania się w odgłosy natury i wzięcia udziału w spektaklu, jaki oferuje światło. Zapraszamy Państwa, do odkrywania naszej niezwykłej kolekcji...Lucoa', 'Zapraszamy , niezwykłą, podróż, królestwie, światłaW, naszej, kolekcji, znajdziecie, Państwo, zjawiskowe, które, odmienią, wnętrze, nadając, ponadczasowy, charakter,  Lampy, dzięki, którym, zachodzie, słońca, przestrzeń, emanuje, subtelnym, ciepłem, światła, cienia, hipnotyzuje, urzekaNiepowtarzalny, wygląd, naszej, kolekcji, czaruje, rzeczywistość, limity, wyznacza, jedynie, wyobraźnia, kreatorówLampy, które, proponujemy , uwodzą, oryginalnym, wzornictwem, niezwykłą, lekkością, Stanowią, subtelną, biżuterię, wnętrza , intrygują, przyciągają, Stworzone, wykorzystaniem, najwyższej, jakości, materiałów, jednocześnie, eleganckie, funkcjonalne, Doskonałe, podkreślenia, walorów, wybranej, przestrzeni, odpowiedniej, aranżacji, stanowią, stylową, dekorację, dyskretnie, budując, nastrój, światłem, uczyniliśmy, sztukę, ubierając, najprzeróżniejsze, kształty, nowoczesnych, poprzez, klasyczne, czasem, żartobliwe, szalone, odrealnią, domową, przestrzeń, dodadzą, lekkościDodatkowo, ekskluzywna, kolekcja, ogrodowych, rozświetli, letnie, wieczory, Zaprosi, wyjścia, zewnątrz, wsłuchania, odgłosy, natury, wzięcia, udziału, spektaklu, oferuje, światło, Zapraszamy, Państwa, odkrywania, naszej, niezwykłej, kolekcjiLucoa'),
