	(1575, 'pl', 'Melba pokonała mistrzów zatrzymali ich Policjanci........', 'Drużyna Melby w kolejnym swoim meczu pokonała aktualnych mistrzów Complex Ligi Orlikowej 12:6 po bardzo dobrym stojącym na wysokim poziomie meczu.Sygnalizowana od początku sezonu zwyżka formy zawodników Melby znalazła potwierdzenie w tym meczu . Oldboje mimo iż mają w swoich szeregach dwóch najlepszych strzelców ligi nie byli w stanie im zagrozić ponieważ ich forma strzelecka tym razem nie była ich najmocniejszą stroną. Łowcy bramek pudłowali w najdogodniejszych sytuacjach. Melba jak zawsze składnie, spokojnie i skutecznie ich wypunktowała.Po tym sukcesie zatrzymali rozpędzoną Melbę ( mocno osłabiona drużyna Melby - brak Jarosława Kota ,Jacka Kota,Michała Mędrali ) Policjanci.Mocna drużyna Policjantów zaskoczyła przeciwników swoją agresją , walecznością i skutecznością na co mocno osłabiona drużyna Melby nie znalazła recepty i poniosła drugą w tym sezonie porażkę.', 'Drużyna, kolejnym, pokonała, aktualnych, mistrzów, Complex, Orlikowej, bardzo, dobrym, stojącym, wysokim, poziomie, meczuSygnalizowana, początku, sezonu, zwyżka, zawodników, znalazła, potwierdzenie, Oldboje, swoich, szeregach, dwóch, najlepszych, strzelców, stanie, zagrozić, ponieważ, strzelecka, najmocniejszą, stroną, Łowcy, bramek, pudłowali, najdogodniejszych, sytuacjach, zawsze, składnie, spokojnie, skutecznie, wypunktowałaPo, sukcesie, zatrzymali, rozpędzoną, Melbę, osłabiona, drużyna, Jarosława, KotaMichała, Mędrali, PolicjanciMocna, drużyna, Policjantów, zaskoczyła, przeciwników, swoją, agresją, walecznością, skutecznością, osłabiona, drużyna, znalazła, recepty, poniosła, drugą, sezonie, porażkę'),
