	(1576, 'pl', 'Kaprin po dwóch porażkach i remisie wygrywa........', 'Drużyna Kaprinu po dwóch porażkach 9:10 z Policjantami , 4:8 z Complexem oraz remisie 3:3 z LO Krzeszowice tym razem pewnie pokonali 8:2 FC Cressouicy 1286 . Mimo zwycięstwa drużyna Kaprinu nie zachwyciła swoją grą licznie zgromadzonej publiczności. Wszyscy zastanawiali się nad przyczyną ich słabej gry mając nadzieję , że to był mecz zwycięski " na przełamanie".', 'Drużyna, Kaprinu, dwóch, porażkach, Policjantami, Complexem, remisie, Krzeszowice, pewnie, pokonali, Cressouicy, zwycięstwa, drużyna, Kaprinu, zachwyciła, swoją, licznie, zgromadzonej, publiczności, Wszyscy, zastanawiali, przyczyną, słabej, mając, nadzieję, zwycięski, przełamanie"'),
	(1577, 'pl', 'Complex stracił pierwsze punkty z Oldbojami......', 'Drużyna Complexu nie straciła do tej pory punktów w Complex Lidze Orlikowej. Ale tym razem na ich drodze stanęli aktualni mistrzowie CLO mocno zdeterminowani i zmotywowani, żeby pokazać młodym kolegom kto tu rządzi w Krzeszowicach. Po bardzo dobrym meczu stojącym na bardzo dobrym poziomie padł wynik remisowy 8:8 co z przebiegu meczu jest wynikiem sprawiedliwym. Jedna i druga drużyna miały swoje sytuacje "meczowe" ale ich nie wykorzystały. Jedno jest pewne poziom naszej ligi stale się podnosi i wyrównuje. W tej chwili trudno byłoby wskazać drużyny , które wywalczą miejsce na podium poza drużyną Complexu , która ma najwięcej punktów i w dalszym ciągu pozostaje głównym kandydatem do tytułu mistrzowskiego.', 'Drużyna, Complexu, straciła, punktów, Complex, Orlikowej, drodze, stanęli, aktualni, mistrzowie, zdeterminowani, zmotywowani, pokazać, młodym, kolegom, rządzi, Krzeszowicach, bardzo, dobrym, stojącym, bardzo, dobrym, poziomie, remisowy, przebiegu, wynikiem, sprawiedliwym, drużyna, miały, sytuacje, "meczowe", wykorzystały, poziom, naszej, podnosi, wyrównuje, chwili, trudno, byłoby, wskazać, drużyny, które, wywalczą, miejsce, podium, drużyną, Complexu, która, najwięcej, punktów, dalszym, ciągu, pozostaje, głównym, kandydatem, tytułu, mistrzowskiego'),
	(1578, 'pl', 'LO Krzeszowice fajną drużynę mają i pewnie punkty zdobywają.....', 'LO Krzeszowice fajną drużynę mają i pewnie punkty zdobywają . Po remisowym meczu z brązowymi medalistami poprzedniego sezonu drużyną Kaprin 3:3 tym razem licealiści pewnie pokonali 6:3 drużynę Dominium. Po tym zwycięstwie LO Krzeszowice jest już na 4 miejscu ustępując jednym punktem Policjantom oraz drużynie Melby. Jeżeli dalej zawodnicy LO bedą tak skutecznie i widowiskowo mają realne szanse na podium.', 'Krzeszowice, fajną, drużynę, pewnie, punkty, zdobywają, remisowym, brązowymi, medalistami, poprzedniego, sezonu, drużyną, Kaprin, licealiści, pewnie, pokonali, drużynę, Dominium, zwycięstwie, Krzeszowice, miejscu, ustępując, jednym, punktem, Policjantom, drużynie, Jeżeli, zawodnicy, skutecznie, widowiskowo, realne, szanse, podium'),
	(1579, 'pl', 'Taras lepszy o 1 bramkę od KW Czatkowice......', 'Mimo deszczu i burzy zawodnicy Tarasu i KW Czatkowice rozegrali ciekawe i emocjonujące widowisko.Początek meczu należał do drużyny Tarasu , która grała szybciej i skuteczniej dzięki czemu do przerwy prowadziła 3:1.Drugą połowę wygrała drużyna KW Czatkowice 3:2 ale w całym spotkaniu lepszą o jedną bramką 5:4 okazała się drużyna Tarasu.', 'deszczu, zawodnicy, Tarasu, Czatkowice, rozegrali, ciekawe, emocjonujące, widowiskoPoczątek, należał, drużyny, Tarasu, która, grała, szybciej, skuteczniej, dzięki, przerwy, prowadziła, 3:1Drugą, połowę, wygrała, drużyna, Czatkowice, całym, spotkaniu, lepszą, jedną, bramką, okazała, drużyna, Tarasu'),
