	(1581, 'pl', 'WItamy na stronie AP Świt Krzeszowice', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum', 'consectetur, adipiscing, eiusmod, tempor, incididunt, labore, dolore, aliqua, veniam, nostrud, exercitation, ullamco, laboris, aliquip, commodo, consequat, reprehenderit, voluptate, cillum, dolore, fugiat, pariatur, Excepteur, occaecat, cupidatat, proident, officia, deserunt, mollit, laborum'),
	(1590, 'pl', 'Dzień Dziecka z UKS " Jedynka" i GKS Świt Krzeszowice- U- 2001', ' \r\nDzień Dziecka z UKS " Jedynka" i z GKS Świt Krzeszowice turniej piłki nożnej chłopców U-2001Wyniki: I miejsce GKS Świt Krzeszowice 1. II miejsce Jutrzenka Giebułtów. III miejsce Skała\'\' Jaguary". IV miejsce Alwernia. V miejsce Skała" Tygrysy". VI miejsce GKSŚwit Krzeszowice 2. VII miejsce Wola Filipowska. Organizatorem turnieju w tej kategorii był trener GKS Świt Krzeszowice Adrian Kaczkowski\r\nDzień Dziecka z UKS" Jedynka" i Świtem Krzeszowice..Dnia 07.06.2014 odbył się pierwszy turniej Orlików z okazji Dnia Dziecka w Krzeszowicach zorganizowany przez GKS "ŚWIT" KRZESZOWICE ORAZ UKS "JEDYNKA". Zawody otworzył Burmistrz Gminy Krzeszowice Czesław Bartl który był mile zaskoczony organizacją Turnieju. Mecze były grane systemem grupowym w Gr A wystąpiły drużyny: AP Kmita Zabierzów I , Świt Krzeszowice II, Lotnik Kryspinów II oraz UKS Mników. W Gr B wystąpiły : AP Kmita Zabierzów II, Świt Krzeszowice I oraz Lotnik Kryspinów I. Pierwsze miejsce w grupach zajęły kolejno AP Kmita Zabierzów I oraz AP Kmita Zabierzów II , Drugie miejsca w grupach zajęły drużyny Lotnika Kryspinów. Nasze Drużyny zajęły V i VII miejsca. Pierwsze 4 miejsca zajęły AP Kmita Zabierzów i Lotnik Kryspinów które deklasowały wszystkie drużyny. Na zakończenie turniej zamknął i wręczył nagrody Prezes zarządu UKS "JEDYNKA" Pan Wojciech Kardas.Świt Krzeszowice wystąpił w składzie: Michał Kajdas - Maciej Ślusarczyk, Gabriel Niemiec, Karol Szecówka, Bartek Olesiński, Łukasz Kurdziel, Szymon Setkowicz , Alan Macałka, Dominik Kurdziel, Jaś Dadej, Kuba Rutyna, Wiktor Bartosik, Aleks Bochenek, Mikołaj, Duszan Młynarczyk. Organizatorem turnieju w tej kategorii był trener GKS Świt Krzeszowice Krystian Kowalczyk.', ' \r\nDzień, Dziecka, Jedynka", Krzeszowice, turniej, piłki, nożnej, chłopców, U2001Wyniki:, miejsce, Krzeszowice, miejsce, Jutrzenka, Giebułtów, miejsce, Skała\'\', Jaguary", miejsce, Alwernia, miejsce, Skała", Tygrysy", miejsce, GKSŚwit, Krzeszowice, miejsce, Filipowska, Organizatorem, turnieju, kategorii, trener, Krzeszowice, Adrian, Kaczkowski\r\nDzień, Dziecka, Jedynka", Świtem, KrzeszowiceDnia, 07062014, odbył, pierwszy, turniej, Orlików, okazji, Dziecka, Krzeszowicach, zorganizowany, "ŚWIT", KRZESZOWICE, "JEDYNKA", Zawody, otworzył, Burmistrz, Krzeszowice, Czesław, który, zaskoczony, organizacją, Turnieju, systemem, grupowym, wystąpiły, drużyny:, Zabierzów, Krzeszowice, Lotnik, Kryspinów, Mników, wystąpiły, Kmita Zabierzów, Krzeszowice, Lotnik, Kryspinów, Pierwsze, miejsce, grupach, zajęły, kolejno, Zabierzów, Zabierzów, Drugie, miejsca, grupach, zajęły, drużyny, Lotnika, Kryspinów, Drużyny, zajęły, miejsca, Pierwsze, miejsca, zajęły, Zabierzów, Lotnik, Kryspinów, które, deklasowały, wszystkie, drużyny, zakończenie, turniej, zamknął, wręczył, nagrody, Prezes, zarządu, "JEDYNKA", Wojciech, KardasŚwit, Krzeszowice, wystąpił, składzie: Michał, Kajdas, Maciej, Ślusarczyk, Gabriel, Niemiec, Szecówka, Bartek, Olesiński, Łukasz, Kurdziel, Szymon, Setkowicz, Macałka, Dominik, Kurdziel, Rutyna, Wiktor, Bartosik, Bochenek, Mikołaj, Duszan, Młynarczyk, Organizatorem, turnieju, kategorii, trener, Krzeszowice, Krystian, Kowalczyk'),
	(1588, 'pl', 'Turnieje z okazji Dnia Dziecka 2014', 'Oprócz imprez rekreacyjnych były również rozegrane turnieje z okazji Dnia Dziecka.:Piłka siatkowa dziewcząt - w turnieju udział wzięły 4 drużyny tj: Gimnazjum nr. 2 z Libiąża I i II zespół , Zespół Szkół w Zalasiu oraz Publiczne Gimnazjum w Krzeszowicach.A oto wyniki spotkań : PG Krzeszowice : Gimnazjum nr 2 Libiąż II zespół 2:0Gimnazjum nr. 2 Libiąż I : Zespół Szkół w Zalasiu 2:0PG Krzeszowice : Gimnazjum nr 2 Libiąż I zespół 1:2ZS w Zalasiu : Gimnazjum nr. 2 Libiąż II 1:2PG Krzeszowice : ZS w Zalasiu 2:0Gimnazjum Libiąż nr 2 I : Gimnazjum Libiąż nr 2 II 2:0\r\n\r\nTurniej halowej piłki nożnej chłopców U-98 o mistrzostwo Gminy Krzeszowice w rywalizacji sołectw i osiedli .W turnieju udział wzięły :Gr. A Sanka Wola Filipowska, Os. Parkowe, Os. CentrumGr. B Filipowice, Nawojowa Góra, MiękiniaA oto wyniki meczów:Gr A1.Wola Filipowska : Os. Parkowe 2:1Pałka 1, Jarosiński 1 / Jaworski M 12.Sanka : Os. Centrum 9:0Malik P 7,Pażdzior 1,Cyganik 13.Os. Centrum : Wola Filipowska 0:5 Jarosiński 3, Konarski 1, Bachowski 1\r\n4. Sanka : Os. Parkowe 0:05. Wola Filipowska : Sanka 1:0Jarosiński 16. Os. Centrum : Os. Parkowe 0:9Jaworski 4, Głowacz 3,Kubica 1, Kurdziel 1Gr. B1.Filipowice : Nawojowa Góra 1:3Kłeczek K 1 / Surówka 1, Wróbel 1, Dziedziak 12.Miękinia : Os. Jurajskie 1:1Borowski B 1 / Ziarkowski B 13. Os. Jurajskie : Filipowice 2:3Ziarkowski B 2 / Lorek J 2, Noworyta A 1\r\nOs Parkowe : Nawojowa Góra 2:1Głowacz 1, Kubica 1Filipowice : Wola Filipowska 2:3Kłeczek K 1 / Konarski, Bachowski, Jarosiński 1Lorek J 1\r\nMecz o 5 miejsce się nie odbył ponieważ Sanka oddała mecz walkowerem. Tym sposobem Os. Jurajskie zajęło 5 miejsce w turnieju.Mecz o 7 miejsce Miękinia : Os. Centrum 1:3Cekiera 1 / Knapik 3Mecz o 3 miejsce Filipowice : Nawojowa Góra 3:0Kłeczek Ł 1Lorek J 2\r\nMecz o 1 miejsceOs. Parkowe : Wola Filipowska 1:2Jaworski M 1 / Jarosiński 2\r\nTurniej halowej piłki nożnej U- 99 i młodsi. W turnieju udział wzięło 9 zespo