	(1586, 'pl', 'Taki dzień się zdarza raz tylko raz w roku i więcej nie jak zatrzymać czas jak zatrzymać ten najpiękniejszy w życiu dzień..... Dzień Dziecka pt. " Krzeszowice Dzieciom', 'Dzień Dziecka pt. " Krzeszowice Dzieciom"został zorganizowany przez UKS " Jedynka " pod honorowym patronatem Burmistrza Gminy Krzeszowice we współpracy z Publicznym Gimnazjum w Krzeszowicach, Osiedlem Jurajskie, Gminnym Klubem Sportowym Świt Krzeszowice, Grupą Oazową przy Kościele św Marcina oraz Pełnomocnikiem Burmistrza d/s Profilaktyki.\r\n\r\nPo raz kolejny dzieci miały swój dzień wspaniałej, beztroskiej i bezpłatnej zabawy .Do atrakcji w tym roku należały: euro bungee, zjeżdżalnia ,ściana wspinaczkowa, quady, jazdę samochodami terenowymi,szczudlarze, animator zabaw dla dzieci, malowanie twarzy, wóz strażacki, wóz policyjny, lody Melba, Lody firmy Iglotex, Wata cukrowa, popcorn,kiełbaski,balony i inne cenne nagrody. Wszystkie atrakcje były dla dzieci bezpłatne dzięki licznym darczyńcom takim jak: Kopalnie Wapienia Czatkowice, Kopalnie Porfiru i Diabazu, firmie Kaprin,Szkoła Języków Obcych Complex, Rimix, Osiedle Jurajskie, Base System, Archidraft, E-Hydrotime,Elektro-system, Tarasbud,Dor-Med, Kris-Pol,Melba, Dolce Vita, Więcek, Tarnowski Sklep Mięsny, Orlen K&amp;K, Auto Janus,Iglotex, Pol- Mak sp. Z o.o. Eden Springs,Kulkolandia Tenczynek.Cała impreza z okazji Dnia Dziecka była organizowana przy wsparciu finansowym Gminy Krzeszowice.\r\n \r\n', 'Dzień, Dziecka, Krzeszowice, Dzieciom"został, zorganizowany, Jedynka, honorowym, patronatem, Burmistrza, Krzeszowice, współpracy, Publicznym, Gimnazjum, Krzeszowicach, Osiedlem, Jurajskie, Gminnym, Klubem, Sportowym, Krzeszowice, Grupą, Oazową, Kościele, Marcina, Pełnomocnikiem, Burmistrza, Profilaktyki\r\n\r\nPo, kolejny, dzieci, miały, dzień, wspaniałej, beztroskiej, bezpłatnej, zabawy, atrakcji, należały:, bungee, zjeżdżalnia, ściana, wspinaczkowa, jazdę, samochodami, terenowymiszczudlarze, animator, dzieci, malowanie, twarzy, strażacki, policyjny, Iglotex, cukrowa, popcornkiełbaskibalony, nagrody, Wszystkie, atrakcje, dzieci, bezpłatne, dzięki, licznym, darczyńcom, Kopalnie, Wapienia, Czatkowice, Kopalnie, Porfiru, Diabazu, firmie, KaprinSzkoła, Języków, Obcych, Complex, Osiedle, Jurajskie, System, Archidraft, EHydrotimeElektrosystem, TarasbudDorMed, KrisPolMelba, Więcek, Tarnowski, Mięsny, K&amp;K, JanusIglotex, SpringsKulkolandia, TenczynekCała, impreza, okazji, Dziecka, organizowana, wsparciu, finansowym, Krzeszowice\r\n \r\n'),
