	(1593, 'pl', 'Koniec pierwszej rundy Complex Ligi Orlikowej.', 'Zakończyła się 1 runda Complex Ligi Orlikowej. Druga runda oraz kilka zaległych spotkań rozegrane zostaną pod koniec sierpnia.\r\nTermin II rundy zostanie podany na 3 tygodnie przed jej rozpoczęciem.', 'Zakończyła, Complex, Orlikowej, zaległych, spotkań, rozegrane, zostaną, koniec, sierpnia\r\nTermin, zostanie, podany, tygodnie, rozpoczęciem'),
