	(1596, 'pl', 'Szkoła Języków Obcych Complex  zaprasza.', 'Uwaga Uwaga Najlepsza jakość , największa skuteczność oraz przystępne ceny nauki języków obcych tylko w Szkole Języków Obcych Complex.Na dodatek dla zawodników i zawodniczek GKS Świt Krzeszowice oraz UKS " Jedynka " przy Gimnazjum w Krzeszowicach nauka języków po promocyjnych cenach. W szczególnych przypadkach istnieje możliwość zwolnienia z opłat za kurs jęzków obcych.Na dodatek Szkoła Języków Obcych Complex razem z GKS Świt i UKS " Jedynka" realizuje program " Przez Sport do Europy" a w ramach programu:1. Wizyty naszych sportowców w zagranicznych ambasadach.2. Wyjazdy na turnieje i zawody międzynarodowe.3.Organizowanie międzynarodowych turniejów i zawodów w Krzeszowicach na stadionie GKS Świt oraz na hali Widowiskowo Sportowej przy Gimnazjum w Krzeszowicach.4.Organizowanie integracyjnych obozów sportowych dla naszych sportowców oraz grup zagranicznych .\r\n\r\nWięc nie zwlekaj już dziś zadzwoń , wypytaj i zapisz się na prywatny kurs języka , który sobie wybierzesz do Szkoły Języków Obcych Complex.\r\nZnajomość języków obcych - sport na dobrym poziomie - wspaniała zabawa- czyli Complex.\r\n', 'Najlepsza, jakość, największa, skuteczność, przystępne, języków, obcych, Szkole, Języków, Obcych, ComplexNa, dodatek, zawodników, zawodniczek, Krzeszowice, Jedynka, Gimnazjum, Krzeszowicach, języków, promocyjnych, cenach, szczególnych, przypadkach, istnieje, możliwość, zwolnienia, opłat, jęzków, obcychNa, dodatek, Szkoła, Języków, Obcych, Complex, Jedynka", realizuje, program, Przez Sport, Europy", ramach, programu:1, Wizyty, naszych, sportowców, zagranicznych, ambasadach2, Wyjazdy, turnieje, zawody, międzynarodowe3Organizowanie, międzynarodowych, turniejów, zawodów, Krzeszowicach, stadionie, Widowiskowo, Sportowej, Gimnazjum, Krzeszowicach4Organizowanie, integracyjnych, obozów, sportowych, naszych, sportowców, zagranicznych, zwlekaj, zadzwoń, wypytaj, zapisz, prywatny, języka, który, wybierzesz, Szkoły, Języków, Obcych, Complex\r\nZnajomość, języków, obcych, dobrym, poziomie, wspaniała, zabawa, Complex\r\n'),
	(1597, 'pl', 'Liga Orlikowa dla dorosłych II runda', 'W poniedziałek 1.09.2014 r. startuje II runda rozgrywek ligi orlikowej dla dorosłych. Do piątku 29 sierpnia przyjmuję propozycję do terminarza.Zapraszam do dalszej zabawy.', 'poniedziałek, 1092014, startuje, rozgrywek, orlikowej, dorosłych, piątku, sierpnia, przyjmuję, propozycję, terminarzaZapraszam, dalszej, zabawy'),
	(1598, 'pl', 'Kto zatrzyma Policjantów ? ', 'Kto zatrzyma Policjantów ? Mistrzowie w odwrocie......Complex goni lidera.....Kaprin poza podium.....Druga runda trudniejsza dla drużyny LO......Dominium o krok od wygranej z mistrzami po bardzo dobrej grze...Melba coraz bliżej lidera.....\r\nPolicjanci po dwóch kolejkach Complex Ligi Orlikowej znajdują się na pozycji lidera. Jest to zasługa całej drużyny , która gra bardzo dobrze skutecznie i widowiskowo. W tej formie będzie trudna do zatrzymania dla każdego przeciwnika. W pierwszych dwóch kolejkach Policjanci pokonali aktualnych mistrzów ligi orlikowej poprzedniego sezonu drużynę Oldboje 16:7 oraz bardzo grożny zespół LO 6:1. W obu meczach Policjanci dominowali na boisku.\r\nAktualni mistrzowie ligi orlikowej poprzedniego sezonu drużyna Oldboje Krzeszowic w pierwszym meczu ponieśli sromotną porażkę 7:16 z Policjantami. W drugiej kolejce sensacyjnie zremisowali z ostatnią drużyną w tabeli Dominium ratując remis w ostatnich minutach meczu.Słabe wyniki Oldbojów są wynikiem braków personalnych w zespole spowodowanych licznymi kontuzjami co sprawia że drużyna właściwie w każdym meczu gra w dużym osłabieniu.Ale ambicji ,woli walki i zadziorności grającym w tej drużynie zawodnikom można pozazdrościć. Mamy nadzieję , że jeszcze dla Oldbojów przyjdą lepsze dni i zostaną wzmocnieni równie dobrymi, ambitnymi i zadziornymi zawodnikami z tej kategorii.\r\nDrużyna Complex po porażce w pierwszej rundzie z Policjantami znajduje się na drugim miejscu i musi gonić lidera. Nie będzie to łatwe ponieważ drużyna Policjantów prezentuje bardzo wysoką formę.\r\nW zeszłym sezonie drużyna Kaprin zajęła II miejsce w rozgrywkach co było najlepszym wynikiem młodej drużyny w historii jej startów w lidze orlikowej.W tym sezonie wicemistrzowie prezentują niestety słabą formę i aktualnie znajdują się za podium ze stratą 8 punktów do lidera i wicelidera.W pierwszej kolejce rundy rewanżowej drużyna Kaprin poległa w meczu z Complexem 18:8. W drugiej kolejce wysoko pokonali KW Czatkowice 16:5 dając nadzieję na lepszą drugą rundę w jaj wykonaniu.\r\nLO po pierwszej rundzie znajdował się wysoko w tabeli z apetytami na miejsce na podium. Niestety w obu kolejkach rundy rewanżowej licealna młodzież poniosła dwie porażki oddalając się od podium.W pierwszym meczu LO przegrało z Melbą 9:5 a w drugim uległo Policjantom 1:6. Myślę jednak , że drużyna ta nie powiedziała jeszcze ostatniego słowa i powalczy jeszcze o miejsce na podium.\r\nDrużyna Dominium skazana na porażkę w meczu z drużyną Oldboje Krzeszowic wysoko podniosła poprzeczkę i odniosła zasłużony remis prezentując bardzo dobrą widowiskową grę czym zaskoczyli swoich przeciwników oraz licznie zgromadzonych kibiców. Na dodatek mieli zwycięstwo w rękach jeszcze na dwie minuty przed końcem meczu . Niestety póżniej Oldboje doprowadzili do remisu , którego żadnej z drużyn nie udało się zamienić na zwycięstwo.\r\nDrużyna Melby po zwycięstwach nad Kaprinem 7:5 oraz LO 9:5 znajduje się coraz bliżej pozycji lidera. Melba od dłuższego czasu prezentuje wysoką formę co w tym sezonie skutkować może nawet tytułem mistrzowskim lub w najgorszym przypadku miejscem na podium. Trzymamy kciuki i życzymy powodzenia.', 'zatrzyma, Policjantów,  Mistrzowie, odwrocieComplex, lideraKaprin, podiumDruga, trudniejsza, drużyny, LODominium, wygranej, mistrzami, bardzo, dobrej, grzeMelba, bliżej, lidera\r\nPolicjanci, dwóch, kolejkach, Complex, Orlikowej, znajdują, pozycji, lidera, zasługa, całej, drużyny, która, bardzo, dobrze, skutecznie, widowiskowo, formie, będzie, trudna, zatrzymania, każdego, przeciwnika, pierwszych, dwóch, kolejkach, Policjanci, pokonali, aktualnych, mistrzów, orlikowej, poprzedniego, sezonu, drużynę, Oldboje, bardzo, grożny, zespół, meczach, Policjanci, dominowali, boisku\r\nAktualni, mistrzowie, orlikowej, poprzedniego, sezonu, drużyna, Oldboje, Krzeszowic, pierwszym, ponieśli, sromotną, porażkę, Policjantami, drugiej, kolejce, sensacyjnie, zremisowali, ostatnią, drużyną, tabeli, Dominium, ratując, ostatnich, minutach, meczuSłabe, wyniki, Oldbojów, wynikiem, braków, personalnych, zespole, spowodowanych, licznymi, kontuzjami, sprawia, drużyna, właściwie, każdym, dużym, osłabieniuAle, ambicji, zadziorności, grającym, drużynie, zawodnikom, można, pozazdrościć, nadzieję, jeszcze, Oldbojów, przyjdą, lepsze, zostaną, wzmocnieni, równie, dobrymi, ambitnymi, zadziornymi, zawodnikami, kategorii\r\nDrużyna, Complex, porażce, pierwszej, rundzie, Policjantami, znajduje, drugim, miejscu, gonić, lidera, będzie, łatwe, ponieważ, drużyna, Policjantów, prezentuje, bardzo, wysoką, formę\r\nW, zeszłym, sezonie, drużyna, Kaprin, zajęła, miejsce, rozgrywkach, najlepszym, wynikiem, młodej, drużyny, historii, startów, orlikowejW, sezonie, wicemistrzowie, prezentują, niestety, słabą, formę, aktualnie, znajdują, podium, stratą, punktów, lidera, wicelideraW, pierwszej, kolejce, rewanżowej, drużyna, Kaprin, poległa, Complexem, drugiej, kolejce, wysoko, pokonali, Czatkowice, dając, nadzieję, lepszą, drugą, rundę, wykonaniu\r\nLO, pierwszej, rundzie, znajdował, wysoko, tabeli, apetytami, miejsce, podium, Niestety, kolejkach, rewanżowej, licealna, młodzież, poniosła, porażki, oddalając, podiumW, pierwszym, przegrało, Melbą, drugim, uległo, Policjantom, Myślę, jednak, drużyna, powiedziała, jeszcze, ostatniego, słowa, powalczy, jeszcze, miejsce, podium\r\nDrużyna, Dominium, skazana, porażkę, drużyną, Oldboje, Krzeszowic, wysoko, podniosła, poprzeczkę, odniosła, zasłużony, prezentując, bardzo, dobrą, widowiskową, zaskoczyli, swoich, przeciwników, licznie, zgromadzonych, kibiców, dodatek, zwycięstwo, rękach, jeszcze, minuty, końcem, Niestety, póżniej, Oldboje, doprowadzili, remisu, którego, żadnej, drużyn, udało, zamienić, zwycięstwo\r\nDrużyna, zwycięstwach, Kaprinem, znajduje, bliżej, pozycji, lidera, dłuższego, prezentuje, wysoką, formę, sezonie, skutkować, tytułem, mistrzowskim, najgorszym, przypadku, miejscem, podium, Trzymamy, kciuki, życzymy, powodzenia'),
	(1599, 'pl', 'Startuje kolejna edycja Kaprin Futsal League', '27 Pażdziernika rusza kolejna runda Kaprin Futsal League.Zgłoszenia przyjmujemy do 24 pażdziernika. Mecze będą rozgrywane będą w poniedziałki od 20 oraz w piątki od 19.30.Obrońcą tytułu mistrzowskiego jest drużyna Szkoły Języków Obcych Complex.Complex, Kaprin oraz Archidraft to drużyny , które już się zgłosiły do rozgrywek. Czekamy na pozostałe drużyny. Szczegółowe informacje pod numerem 696459906\r\nArchidraft to mistrz ligi halowej U-97 z roku 2013 oraz zwycięzca turnieju mikołajkowego  w tej kategorii w którym pokonał drużynę mistrzów Polski drużynę  Wisły Krakbet Kraków', 'Pażdziernika, kolejna, Kaprin, Futsal, LeagueZgłoszenia, przyjmujemy, pażdziernika, będą, rozgrywane, będą, poniedziałki, piątki, 1930Obrońcą, tytułu, mistrzowskiego, drużyna, Szkoły, Języków, Obcych, ComplexComplex, Kaprin, Archidraft, drużyny, które, zgłosiły, rozgrywek, Czekamy, pozostałe, drużyny, Szczegółowe, informacje, numerem, 696459906\r\nArchidraft, mistrz, halowej, zwycięzca, turnieju, mikołajkowego, kategorii, którym, pokonał, drużynę, mistrzów, Polski, drużynę,  Wisły, Krakbet, Kraków'),
	(1600, 'pl', 'Śladami Jana Pawła II', 'Mecz Reprezentacji Polski Oldbojów z Oldbojami Krzeszowic 29 pażdziernika 2014 o godz. 20.00 w hali widowiskowo sportowej przy ulicy Długiej 22.Tak się składa ,że część z nas było bierzmowanych przez Jana Pawła II dlatego gramy ten wielki mecz , żeby uczcić pamięć Św Jana Pawła II.W trakcie turnieju odśpiewana zostanie ukochana przez papieża barka.Udział w reprezentacji zapowiedział trener GKS " Świt " Krzeszowice Maciej Antkiewicz. Zapraszamy serdecznie wszystkich kibiców do oglądania tego wspaniałego meczu oraz odśpiewania barki', 'Reprezentacji, Polski, Oldbojów, Oldbojami, Krzeszowic 29, pażdziernika, widowiskowo, sportowej, Długiej, składa, część, bierzmowanych, Pawła, dlatego, wielki, uczcić, pamięć, Pawła, trakcie, turnieju, odśpiewana, zostanie, ukochana, papieża, barkaUdział, reprezentacji, zapowiedział, trener, Krzeszowice, Maciej, Antkiewicz, Zapraszamy, serdecznie, wszystkich, kibiców, oglądania, wspaniałego, odśpiewania'),
	(1601, 'pl', 'Startuje Kaprin Futsal League', 'Startuje Kaprin Futsal League 2014/2015 .\r\n3 listopada w Krzeszowicach startuje Karpin Futsal League .Zgłoszenia do rozgrywek przyjmowane są do 30 pażdziernika. Rozgrywki będą prowadzone od 3 listopada do końca lutego .Szczegółowe informacje pod numerem 696459906.\r\n\r\nDo chwili obecnej zgłosiły się następujące drużyny:Szkoła Języków Obcych Complex, Kaprin, Auto Stop Morawica, Base System, Achidraft, Ren Pol Sankowia. , Tenczynek,Kardi Mobile. Są jeszcze dwa miejsca wolne . Zapraszam do wspólnej zabawy przez zimę.O udział w rozgrywkach naszej ligi pytał również Kamil Kwoka - Victoria Zalas.\r\n', 'Startuje, Kaprin, Futsal, League, 20142015, listopada, Krzeszowicach, startuje, Karpin, Futsal, League, Zgłoszenia, rozgrywek, przyjmowane, pażdziernika Rozgrywki, będą, prowadzone, listopada, końca, lutego, Szczegółowe, informacje, numerem, 696459906\r\n\r\nDo, chwili, obecnej, zgłosiły, następujące, drużyny:Szkoła, Języków, Obcych, Complex, Kaprin, Morawica, System, Achidraft, Sankowia, TenczynekKardi, Mobile, jeszcze, miejsca, Zapraszam, wspólnej, zabawy, zimęO, udział, rozgrywkach, naszej, pytał, również, Victoria'),
	(1602, 'pl', 'Międzynarodowy Mikołajkowy Turniej Halowej Piłki Nożnej Dziewcząt', 'Międzynarodowy mikołajkowy turniej halowej piłki nożnej w Krzeszowicach :1.Dziewczyny U- 99 29/30 listopada 2014 r2.Dziewczyny U- 97 6/7 grudnia 2014 r3. Chłopcy U- 2001 22/23 listopada 2014 r.Wszystkie turnieje będą odbywały się przez 2 dni dla wszystkich drużyn. W zawodach udział bierze po 16 drużyn podzielonych na 4 grupy .Dla gości zagranicznych przewidziany jest nocleg w Publicznym Gimnazjum w Krzeszowicach lub na specjalne życzenie w hotelu. Oferujemy również wyżywienie - katering lub restauracja - posiłki do wyboru po atrakcyjnych cenach.Zapewniamy również napoje , medale , puchary oraz całą masę słodkich upominków od św. Mikołaja.Serdecznie zapraszamy i życzymy udanej zabawy.Zgłoszenia przyjmujemy do do 31 pażdziernika 2014 r.Do chwili obecnej udział w turnieju potwierdziły następujące drużyny w kategorii dziewcząt:Bronowianka Kraków 2 zespoły, Prądniczanka Kraków - 2 zespoły, Victoria Gaj. GKS Świt Krzeszowice, UKS " Jedynka" Krzeszowice, As Progres,- 2 zespoły oraz 5 drużyn ze Słowacji.Informacje pod numerem 696459906 Swój udział w turnieju potwierdziły drużyny ze Słowacji :Rużemberok 2 zespoły , Orawa Team , Mutne oraz Żilina..drużyny uczestniczące w turnieju otrzymują słodkie upominki, napoje, pamiątki, dyplomy oraz puchary. Patronat medialny : Przełom oraz Kobieca Piłka Nożna\r\nOrganizatorzy turnieju : UKS " Jedynka" Krzeszowice oraz Publiczne Gimnazjum w Krzeszowicach we współpracy Urzędem Gminy Krzeszowice oraz CKiS Krzeszowice.\r\n\r\n \r\n\r\n\r\n\r\n\r\n', 'Międzynarodowy, mikołajkowy, turniej, halowej, piłki, nożnej, Krzeszowicach, :1Dziewczyny, listopada, r2Dziewczyny, grudnia, Chłopcy, listopada, rWszystkie, turnieje, będą, odbywały, wszystkich, drużyn, zawodach, udział, bierze, drużyn, podzielonych, gości, zagranicznych, przewidziany, nocleg, Publicznym, Gimnazjum, Krzeszowicach, specjalne, życzenie, hotelu, Oferujemy, również, wyżywienie, katering, restauracja, posiłki, wyboru, atrakcyjnych, cenachZapewniamy, również, napoje, medale, puchary, całą, słodkich, upominków, MikołajaSerdecznie, zapraszamy, życzymy, udanej, zabawyZgłoszenia, przyjmujemy, pażdziernika, chwili, obecnej, udział, turnieju, potwierdziły, następujące, drużyny, kategorii, dziewcząt:Bronowianka, Kraków, zespoły, Prądniczanka, Kraków, zespoły, Victoria, Krzeszowice, Jedynka", Krzeszowice, Progres, zespoły, drużyn, SłowacjiInformacje, numerem, 696459906, udział, turnieju, potwierdziły, drużyny, Słowacji, :Rużemberok, zespoły, Żilinadrużyny, uczestniczące, turnieju, otrzymują, słodkie, upominki, napoje, pamiątki, dyplomy, puchary, Patronat, medialny, Przełom, Kobieca, Piłka, Nożna\r\nOrganizatorzy, turnieju, Jedynka", Krzeszowice, Publiczne, Gimnazjum, Krzeszowicach, współpracy, Urzędem, Krzeszowice, Krzeszowice\r\n\r\n \r\n\r\n\r\n\r\n\r\n'),
	(1603, 'pl', 'Policjanci mistrzem Complex Ligi Orlikowej', 'Zakończyły się rozgrywki Complex Ligi Orlikowej. Mistrzem ligi została drużyna Policjantów z dorobkiem 35 punktów w 14 meczach. Tuż za nimi uplasowała się drużyna Complexu z taką samą ilością punktów lecz gorszym bilansem bezpośrednich meczów (4:4, 7:2). Na trzecim miejscu rozgrywki skończyła Melba z 30 punktami. Królem strzelców został Paweł Łuszcz z mistrzowskiej drużyny, który zdobył 37 bramek. Wszystkim drużynom dziękujemy za udział i serdecznie zapraszamy za rok. A tymczasem już wkrótce startuje kolejny sezon rozgrywek ligi halowej. Są jeszcze ostatnie wolne miejsca.', 'Zakończyły, rozgrywki, Complex, Orlikowej, Mistrzem, została, drużyna, Policjantów, dorobkiem, punktów, meczach, uplasowała, drużyna, Complexu, ilością, punktów, gorszym, bilansem, bezpośrednich, meczów, trzecim, miejscu, rozgrywki, skończyła, punktami Królem, strzelców, został, Paweł, Łuszcz, mistrzowskiej, drużyny, który, zdobył, bramek Wszystkim, drużynom, dziękujemy, udział, serdecznie, zapraszamy, tymczasem, wkrótce, startuje, kolejny, rozgrywek, halowej, jeszcze, ostatnie, miejsca'),
	(1604, 'pl', 'Terminarz meczów Kaprin Futsal League', 'Uwaga podaję terminarz pierwszych meczów Kaprin Futsal League w sezonie 2014/2015.3 listopada 2014 r.1. godz. 20.00 Szkoła Języków Obcych : Dolce Vita 2. godz. 20.45 Kaprin : Base System3. godz. 21.30 Auto Stop Morawica : Archidraft\r\n \r\nJest jeszcze wolne miejsce w rozgrywkach naszej ligi.\r\nMecze na piątek zostaną ustalone najpóżniej we wtorek ok.godz. 21 ponieważ jest jedno wolne miejsce w lidze.\r\nNa piątek czekają następujące drużyny: Kardi Mobile, Ren Pol, ZSP Krzeszowice.\r\nZapraszamy wszystkich chętnych do naszej ligi.Szczegółowe informacje pod numerem 696459906', 'podaję, terminarz, pierwszych, meczów, Kaprin, Futsal, League, sezonie, 201420153, listopada, Szkoła, Języków, Obcych, Vita 2, Kaprin, System3, Morawica, Archidraft\r\n \r\nJest, jeszcze, miejsce, rozgrywkach, naszej, ligi\r\nMecze, piątek, zostaną, ustalone, najpóżniej, wtorek, okgodz, ponieważ, miejsce, lidze\r\nNa, piątek, czekają, następujące, drużyny:, Mobile, Krzeszowice\r\nZapraszamy, wszystkich, chętnych, naszej, ligiSzczegółowe, informacje, numerem, 696459906'),
	(1605, 'pl', 'Kaprin Futsal League 2014/2015', '3 listopada startuje kolejna edycja Kaprin Futsal League !!!!\r\nDo rozgrywek do chwili obecnej zgłosiły się następujące drużyny :1.Szkoła Języków Obcych Complex -aktualny mistrz2.Auto Stop Morawica- wicemistrz poprzedniego sezonu( Piwosze)3.Kaprin - wicemistrz poprzedniego sezonu4.Archidraft - mistrz MLF U - 96 drużyna , która pokonała mistrza Polski Wisłę Krakbet Kraków.5.Base System - również były mistrz MLF U - 966.Ren Pol -były wicemistrz MLF U - 967.Dolce Vita - drużyna młodzieżowa idzie w ślady starszych kolegów , którzyzdobyli już tytuł mistrza Kaprin Futsal League.8.Kardi Mobile - " czarny koń" rozgrywek?9.ZSP - drużyna złożona z mocnych zawodników- uczniów Zespołu Szkół Ponadgimnazjalnych .10.Miejsce czeka na ambitną drużynę , która podejmie się walki o tytuł mistrza ligi i namiesza w szeregach faworytów.', 'listopada, startuje, kolejna, edycja, Kaprin, Futsal, League, rozgrywek, chwili, obecnej, zgłosiły, następujące, drużyny, :1Szkoła, Języków, Obcych, Complex, aktualny, mistrz2Auto, Morawica, wicemistrz, poprzedniego, sezonu(, Piwosze)3Kaprin, wicemistrz, poprzedniego, sezonu4Archidraft, mistrz, drużyna, która, pokonała, mistrza, Polski, Wisłę, Krakbet, Kraków5Base, System, również, mistrz, 966Ren, wicemistrz, 967Dolce, drużyna, młodzieżowa, ślady, starszych, kolegów, którzyzdobyli, tytuł, mistrza, Kaprin, Futsal, League8Kardi, Mobile, czarny, rozgrywek9ZSP, drużyna, złożona, mocnych, zawodników, uczniów, Zespołu, Szkół, Ponadgimnazjalnych, 10Miejsce, ambitną, drużynę, która, podejmie, tytuł, mistrza, namiesza, szeregach, faworytów'),
	(1606, 'pl', 'Same niespodzianki w pierwszym dniu Kaprin Futsal League', 'Pierwszy dzień Kaprin Futsal League i od razu niespodzianki wielkiego formatu.Największą niespodziankę sprawiła drużyna Archidraft , która pokonała zdecydowanego faworyta ligi , aktualnego wicemistrza drużynę Auto Stop Morawica.Jest to tym większe zaskoczenie , że po 18 minutach wynik był 4:1 dla Morawicy jednak wynik końcowy przeszedł najśmielsze oczekiwania albowiem Archidraft wygrał to spotkanie 9:5.\r\nRównież niespodzianką zakończył się mecz pomiędzy drużynami Kaprin i Tsunami Base System, w którym padł wynik remisowy 3:3.Jest to o tyle zaskoczenie , że Kaprin to drużyna stale zajmująca miejsca na podium w naszych rozgrywkach. Tsunami to były mistrz MLF U - 96 debiutujący w rozgrywkach seniorskich.\r\n\r\nNiespodzianki natomiast nie było w meczu aktualnego mistrza ligi zespołu Szkoły Języków Obcych Complex , który pewnie pokonał najmłodszą drużynę ligi Dolce Vitę U - 97. Mimo porażki młodzi zawodnicy zostawili po sobie bardzo dobre wrażenie prowadząc otwartą grę bez respektu dla swoich przeciwników. Wynik tego spotkania 9:4 dla Szkoły Języków Obcych Complex.\r\nTeraz czekamy na kolejne piątkowe mecze i kolejne niespodzianki.Szczegółowy opis pierwszej kolejki będzie wprowadzony w póżniejszym terminie.\r\n', 'Pierwszy, dzień, Kaprin, Futsal, League, niespodzianki, wielkiego, formatuNajwiększą, niespodziankę, sprawiła, drużyna, Archidraft, która, pokonała, zdecydowanego, faworyta, aktualnego, wicemistrza, drużynę, MorawicaJest, większe, zaskoczenie, minutach, Morawicy, jednak, końcowy, przeszedł, najśmielsze, oczekiwania, albowiem, Archidraft, wygrał, spotkanie, 9:5\r\nRównież, niespodzianką, zakończył, pomiędzy, drużynami, Kaprin, Tsunami, System, którym, remisowy, 3:3Jest, zaskoczenie, Kaprin, drużyna, zajmująca, miejsca, podium, naszych, rozgrywkach, Tsunami, mistrz, debiutujący, rozgrywkach, seniorskich\r\n\r\nNiespodzianki, natomiast, aktualnego, mistrza, zespołu, Szkoły, Języków, Obcych, Complex, który, pewnie, pokonał, najmłodszą, drużynę, porażki, młodzi, zawodnicy, zostawili, bardzo, wrażenie, prowadząc, otwartą, respektu, swoich, przeciwników, spotkania, Szkoły, Języków, Obcych, Complex\r\nTeraz, czekamy, kolejne, piątkowe, kolejne, niespodziankiSzczegółowy, pierwszej, kolejki, będzie, wprowadzony, póżniejszym, terminie\r\n'),
	(1607, 'pl', 'KOKO BIS w Kaprin Futsal League', 'Zgłosiła się kolejna drużyna do Kaprin Futsal League.Ta drużyna to KOKO BIS . Drużyna KOKO grała już w naszej lidze w poprzednich latach i zdążyła zaskarbić sobie rzesze miejscowych kibiców poziomem gry oraz wspaniałą postawą zawodników na boisku. Cieszymy się i życzymy udanej zabawy i jak najlepszych wyników w naszej lidze.', 'Zgłosiła, kolejna, drużyna, Kaprin, Futsal, LeagueTa, drużyna, Drużyna, grała, naszej, poprzednich, latach, zdążyła, zaskarbić, rzesze, miejscowych, kibiców, poziomem, wspaniałą, postawą, zawodników, boisku, Cieszymy, życzymy, udanej, zabawy, najlepszych, wyników, naszej'),
	(1608, 'pl', 'LKS Szaflary  U - 97 zgłoszone do międzynarodowego mikołajkowego turnieju w Krzeszowicach', 'LKS Szaflary to kolejna drużyna dziewcząt zgłoszona do międzynarodowego turnieju mikołajkowego piłki nożnej dziewcząt U - 97, \r\nBardzo mocna obsada szykuje się w międzynarodowym mikołajkowym turnieju halowej piłki nożnej dziewcząt w Krzeszowicach.\r\nSwój udział w turnieju zapowiedziały następujące drużyny:\r\nRożemberok 2 drużyny, Orawa Team , Żilina, Mutne- Słowacja\r\nNaprzód Sobolów 2 drużyny, AS Progres 2 drużyny, Prądniczanka 2 drużyny, Bronowianka, Victoria Gaj, Piast Skawina, Chrzanów, LKS Szaflary, GKS Świt Krzeszowice, UKS " Jedynka " Krzeszowice.Będzie się działo.', 'Szaflary, kolejna, drużyna, dziewcząt, zgłoszona, międzynarodowego, turnieju, mikołajkowego, piłki, nożnej, dziewcząt, 97 \r\nBardzo, obsada, szykuje, międzynarodowym, mikołajkowym, turnieju, halowej, piłki, nożnej, dziewcząt, Krzeszowicach\r\nSwój, udział, turnieju, zapowiedziały, następujące, drużyny:\r\nRożemberok, drużyny, Żilina, Słowacja\r\nNaprzód, Sobolów, drużyny, Progres, drużyny, Prądniczanka, drużyny, Bronowianka, Victoria, Skawina, Chrzanów, Szaflary, Krzeszowice, Jedynka, KrzeszowiceBędzie, działo'),
	(1609, 'pl', 'ZSP Krzeszowice : Ren Pol piątek 19.30', 'Jutro odbędzie się tylko jeden mecz w Kaprin League ponieważ 2 zgłoszone drużyny mają w sobotę mecze turniejowe . W przyszłym tygodniu zagrają po 2 mecze żeby nadrobić zaległości. Piątek 19.30 grają drużyny Ren Pol : ZSP Krzeszowice zapraszamy do wspólnej zabawy', 'odbędzie, Kaprin, League, ponieważ, zgłoszone, drużyny, sobotę, turniejowe, przyszłym, tygodniu, zagrają, nadrobić, zaległości Piątek, grają, drużyny, Krzeszowice, zapraszamy, wspólnej, zabawy'),
	(1610, 'pl', 'Archidraft kontra Base System  piątek godz. 20.20 Kaprin Futsal League.', 'Uwaga Uwaga jutro odbędzie się również drugi mecz Kaprin Futsal League pomiędzy drużynami Base System Archidraft czyli drużynami , które sprawiły w poniedziałkowej kolejce największe sensacje . Ciekawe kto tym razem okaże się lepszy na kogo stawiacie w tym pojedynku?Może na meczu pokażą się sponsorzy obu drużyn. Będzie się działo. Zapraszamy na mecz.', 'odbędzie, również, Kaprin, Futsal, League, pomiędzy, drużynami, System, Archidraft, drużynami, które, sprawiły, poniedziałkowej, kolejce, największe, sensacje, Ciekawe, okaże, lepszy, stawiacie, pojedynkuMoże, pokażą, sponsorzy, drużyn, Będzie, działo, Zapraszamy'),
	(1611, 'pl', 'Kaprin Futsal League', 'Kaprin Futsal League.Zacięte mecze, od pierwszych do ostatnich minut walka na pełnych obrotach, duża ilość bramek i kibiców na trybunach - to efekt piątkowych pojedynków pomiędzy drużynami Ren Pol : ZSP Krzeszowice oraz Archidraft : Bese System.\r\nW pierwszym z tych meczów lepszy o jedną bramkę okazał się ZSP Krzeszowice , który w ostatnich sekundach zdobył zwycięską bramkę z karnego przedłużonego. Tym sposobem ZSP pokonał Ren Pol 5:4.Również drugi pojedynek był bardzo zacięty a wynik spotkania zmieniał z minuty na minutę. Lepiej zaczęli zawodnicy Base System , którzy po 6 minutach prowadzili 2:0. Od 10 minuty do ataku ruszyli zawodnicy Archidraftu i w 33 minucie prowadzili już 4:2. Mimo licznych jeszcze sytuacji strzeleckich nie udało im się zdobyć kolejnych bramek co przy dwóch straconych dało wynik końcowy 4:4. Wynik wydaje mi się sprawiedliwy . Oba mecze stały na bardzo wysokim poziomie . Na boisku pojawiło się szereg bardzo dobrych futsalowców mających swój epizod w drużynie Wisła Krakbet Kraków oraz wcześniej grających w lidze Chrzanowskiej.Szczegóły już jutro.', 'Kaprin, Futsal, LeagueZacięte, pierwszych, ostatnich, pełnych, obrotach, ilość, bramek, kibiców, trybunach, piątkowych, pojedynków, pomiędzy, drużynami, Krzeszowice, Archidraft, System\r\nW, pierwszym, meczów, lepszy, jedną, bramkę, okazał, Krzeszowice, który, ostatnich, sekundach, zdobył, zwycięską, bramkę, karnego, przedłużonego, sposobem, pokonał, 5:4Również, pojedynek, bardzo, zacięty, spotkania, zmieniał, minuty, minutę, Lepiej, zaczęli, zawodnicy, System, którzy, minutach, prowadzili, minuty, ruszyli, zawodnicy, Archidraftu, minucie, prowadzili, licznych, jeszcze, sytuacji, strzeleckich, udało, zdobyć, kolejnych, bramek, dwóch, straconych, końcowy, wydaje, sprawiedliwy, stały, bardzo, wysokim, poziomie, boisku, pojawiło, szereg, bardzo, dobrych, futsalowców, mających, epizod, drużynie, Wisła, Krakbet, Kraków, wcześniej, grających, ChrzanowskiejSzczegóły'),
	(1612, 'pl', 'Terminarz meczów Kaprin Futsal League na następny tydzień.', ' \r\nUwaga podaję terminarz Kaprin Futsal League na następny tydzień.\r\nPoniedziałek 10 listopada 2014 r.1.20.00 Auto Sto Morawica : Base System2.20.45 Kaprin : Dolce Vita3.21.30 Koko BIs : Szkoła Języków Obcych Complex\r\n\r\nPiątek 14 listopada 2014 r. 1. 19.30 ZSP Krzeszowice : Archidraft2. 20.20 Ren Pol : Koko Bis\r\n', ' \r\nUwaga, podaję, terminarz, Kaprin, Futsal, League, następny, tydzień\r\nPoniedziałek, listopada, r12000, Morawica, System22045, Kaprin, Vita32130, Szkoła, Języków, Obcych, Complex\r\n\r\nPiątek, listopada, Krzeszowice, Archidraft2'),
	(1613, 'pl', 'Międzynarodowy Mikołajkowy Turniej Halowej Piłki Nożnej Dziewcząt w Krzeszowicach 2014.', 'vvMIĘDZYNARODOWY MIKOŁAJKOWY TURNIEJHALOWEJ PIŁKI NOŻNEJ DZIEWCZĄTW KRZESZOWICACHU - 99 I MŁODSZE 29/30 LISTOPADA 2014 R.U - 97 I MŁODSZE 6/7 GRUDNIA 2014 R.Uczniowski Klub Sportowy „Jedynka” Krzeszowice oraz Publiczne Gimnazjum w Krzeszowicach we współpracy z Urzędem Gminy w Krzeszowicach oraz Centrum Kultury i Sportu w Krzeszowicach organizuje Międzynarodowy Mikołajkowy Turniej Halowej Piłki Nożnej Dziewcząt Krzeszowice 2014Turniej odbędzie się w dwóch kategoriach wiekowych - kat. 99 i młodsze w dniach 29/30 listopad 2014 r oraz kat. 97 i młodsze w dniach 6/7 grudnia 2014 r. Oba turnieje rozgrywane są przez dwa dni i wszystkie drużyny rozegrają po 6 meczów ( 3/3 sobota/niedziela)Dla uczestników przewidziano atrakcyjne nagrody - dyplomy, puchary, medale dla 3 najlepszych drużyn, zimne napoje , kawa, herbata,lody ciastka i inne słodkie upominki.W turnieju swój udział zapowiedziały czołowe drużyny polskiego kobiecego futsalu ( Naprzód Sobolów 2 zespoły, Bronowianka Kraków, AS Progres 2 zespoły, Prądniczanka Kraków 2 zespoły, Victoria Gaj, Piast Skawina, LKS Szaflary, GKS Świt Krzeszowice, UKS " Jedynka" Krzeszowice) oraz 5 drużyn ze Słowacji. ( Rożemberok- 2 zespoły, Orawa Team, Żilina, Mutne) Zostały jeszcze ostatnie wolne miejsca w turnieju. Kontakt 696-459-906Sponsorzy:Kopalnie Porfiru i Diabazu w Krzeszowicach, Kaprin, Rimix ,Archidraft, Dor Med, Elektro - system, Base System, Szkoła Języków Obcych Complex, Pol Mak, Tarasbud,Melba, Tarnowski Sklep Mięsny, Iglotex,Projekt organizowany jest przy wsparciu finansowym Gminy Krzeszowice.Patronat Medialny: Dziennik Polski, Przełom, Kobieca Piłka Nożna, Magazyn Krzeszowicki.', 'vvMIĘDZYNARODOWY, MIKOŁAJKOWY, TURNIEJHALOWEJ, PIŁKI, NOŻNEJ, DZIEWCZĄTW, KRZESZOWICACHU, MŁODSZE, LISTOPADA, MŁODSZE, GRUDNIA, RUczniowski, Sportowy, „Jedynka”, Krzeszowice, Publiczne, Gimnazjum, Krzeszowicach, współpracy, Urzędem, Krzeszowicach, Centrum, Kultury, Sportu, Krzeszowicach, organizuje, Międzynarodowy, Mikołajkowy, Turniej, Halowej, Piłki, Nożnej, Dziewcząt, Krzeszowice, 2014Turniej, odbędzie, dwóch, kategoriach, wiekowych, młodsze, dniach, listopad, młodsze, dniach, grudnia, turnieje, rozgrywane, wszystkie, drużyny, rozegrają, meczów, sobotaniedziela)Dla, uczestników, przewidziano, atrakcyjne, nagrody, dyplomy, puchary, medale, najlepszych, drużyn, napoje, herbatalody, ciastka, słodkie, upominkiW, turnieju, udział, zapowiedziały, czołowe, drużyny, polskiego, kobiecego, futsalu, Naprzód, Sobolów, zespoły, Bronowianka, Kraków, Progres, zespoły, Prądniczanka, Kraków, zespoły, Victoria, Skawina, Szaflary, Krzeszowice, Jedynka", Krzeszowice), drużyn, Słowacji, Rożemberok, zespoły, Żilina, Mutne), Zostały, jeszcze, ostatnie, miejsca, turnieju, Kontakt, 696459906Sponsorzy:Kopalnie, Porfiru, Diabazu, Krzeszowicach, Kaprin, Archidraft, Med Elektro, system, System, Szkoła, Języków, Obcych, Complex, TarasbudMelba, Tarnowski, Mięsny, IglotexProjekt, organizowany, wsparciu, finansowym, KrzeszowicePatronat, Medialny:, Dziennik, Polski, Przełom, Kobieca, Piłka, Nożna, Magazyn, Krzeszowicki'),
	(1614, 'pl', 'Kaprin Futsal League poniedziałek 10.XI 2014 r.', ' \r\nKaprin Futsal LeaguePoniedziałek 10 listopada 2014 r.1.20.00 Auto Sto Morawica : Base System2.20.45 Kaprin : Dolce Vita3.21.30 Koko BIs : Szkoła Języków Obcych Complex\r\n\r\nJuż za parę godzin zostaną rozegrane kolejne mecze Kaprin Futsal League. Co się będzie działo dzisiaj jakie będą wyniki ?. Czy będą kolejne sensacje? W pierwszym meczu spotkają się aktualny wicemistrz ligi Auto Stop Morawica który w pierwszej kolejce uległ niespodziewanie beniaminkowi rozgrywek drużynie Archidraft ze sprawcą kolejnej niespodzianki - remis z Kaprinem 3:3 - drugim beniaminkiem drużyną Base System. Kto okaże się lepszy na kogo stawiacie?W drugim meczu spotkają się brązowi medaliści poprzedniego sezonu drużyna Kaprin z 3 beniaminkiem najmłodszą drużyną ligi Dolce Vitą. Faworytem wydaje się być drużyna Kaprin ale w sporcie różnie bywa. Czy " młode wilki" pokażą "swoje kły" i sprawią kolejną niespodziankę?Trzeci pojedynek zapowiada się bardzo ciekawie albowiem naprzeciwko siebie staną drużyny aktualnego mistrza ligi zespoł Szkoły Języków Obcych Complex oraz słynąca z bardzo dobrej gry zawsze grożna drużyna Koko Bis.Tak więc czekają nas wielkie emocje i wspaniałe widowiska nad przebiegiem których czuwa bardzo dobry sędzia futsalowy Rafał Ziach, który obecnie sędziuje mecze w ogólnopolskiej lidze futsalu.Wszystkich kibiców serdecznie zapraszamy na halę .\r\n', ' \r\nKaprin, Futsal, LeaguePoniedziałek, listopada, r12000, Morawica, System22045, Kaprin, Vita32130, Szkoła, Języków, Obcych, Complex\r\n\r\nJuż, godzin, zostaną, rozegrane, kolejne, Kaprin, Futsal, League, będzie, działo, dzisiaj, będą, wyniki, będą, kolejne, sensacje W, pierwszym, spotkają, aktualny, wicemistrz, Morawica, który, pierwszej, kolejce, uległ, niespodziewanie, beniaminkowi, rozgrywek, drużynie, Archidraft, sprawcą, kolejnej, niespodzianki, Kaprinem, drugim, beniaminkiem, drużyną, System, okaże, lepszy, stawiacieW, drugim, spotkają, brązowi, medaliści, poprzedniego, sezonu, drużyna, Kaprin, beniaminkiem, najmłodszą, drużyną, Faworytem, wydaje, drużyna, Kaprin, sporcie, różnie, młode, wilki", pokażą, "swoje, sprawią, kolejną, niespodziankęTrzeci, pojedynek, zapowiada, bardzo, ciekawie, albowiem, naprzeciwko, siebie, staną, drużyny, aktualnego, mistrza, zespoł, Szkoły, Języków, Obcych, Complex, słynąca, bardzo, dobrej, zawsze, grożna, drużyna, BisTak, czekają, wielkie, emocje, wspaniałe, widowiska, przebiegiem, których, bardzo, sędzia, futsalowy, Rafał, który, obecnie, sędziuje, ogólnopolskiej, futsaluWszystkich, kibiców, serdecznie, zapraszamy'),
	(1615, 'pl', 'Bez sensacji w poniedziałkowych meczach Kaprin Futsal League ', 'Kaprin Futsal LeagueTym razem nie było sensacji w poniedziałkowych meczach Kaprin Futsal League. W pierwszym meczu pomiędzy drużynami Base System i Auto Stop Morawica oba zespoły wystąpiły w mocno osłabionych składach.W tej sytuacji lepiej poradzili sobie bardzo doświadczeni i ograni w ligach futsalowych zawodnicy zawodnicy Auto Stop.Do przerwy trwała wyrównana walka. Pierwsi bramkę zdobyli zawodnicy Auto Stop Morawica. Na co szybko odpowiedzieli odpowiedzieli zawodnicy Base System doprowadzając do wyrównania i mieli kolejne sytuacje do zdobycia prowadzenia. Niestety niewykorzystane sytuacje zwykle się mszczą. Tak było i tym razem albowiem ci pierwsi jeszcze w pierwszej połowie zdobyli prowadzenie , którego jak się póżniej okazało nie oddali już do końca.W drugiej połowie zawodnicy Auto Stop Morawica zdobyli jeszcze jeszcze 5 bramek tracąc tylko jedną. Końcowy wynik spotkania 7:2 dla Auto Stop Morawica. Drużyna Base System mimo wysokiej porażki zasłużyła na słowa uznania za otwarty styl gry, ambicje i spore umiejętności piłkarskie. Martwi jednak brak skuteczności co spowodowało, że jest taka duża różnica w bramkach mimo dobrej gry.Bramki: Mroziński D. 3, Sawczuk P. 2, Molik D 2- Auto Stop.Zdziech J. 1, Grochal M. 1- Base System.W drugim meczu licznie zgromadzeni na trybunach kibice czekali na kolejną sensację w tych rozgrywkach. Niestety jak się okazało drużyna w tym dniu była nie do zatrzymania przez młody zespół Dolce Vita.Tylko początek mógł znamionować sensację w tym meczu albowiem w 14 minucie meczu wynik był remisowy 1:1. Niestety od tej minuty bramki strzelali już tylko zawodnicy drużyny Kaprin. W pierwszej połowie zdobyli ich jeszcze trzy a w drugiej dołożyli jeszcze 7 co w efekcie dało wynik końcowy 11:1 dla drużyny Kaprin.Bramki: Wąchol P 4, Kłeczek Ł 3, Grzebinoga R 2Stryczek T 1, Nawała B 1 dla Kaprinu oraz Jaworski M 1 dla Dolce Vita.Zgodnie z oczekiwaniami ostatni mecz dostarczył kibicom niesamowitych emocji. Od początku na boisku trwała regularna "piłkarska wojna". Krótkie krycie każdy swego, bardzo dokładne rozgrywanie piłki i mistrzowski sposób wyprowadzania kontry przez jeden i drugi zespół. Początek to delikatnie mówiąc małe zaskoczenie ponieważ 2 bramki zdobyli zawodnicy drużyny Koko. Pierwszą bramkę w 8 minucie zdobył Tomasz Witkowski kończąc wspaniale wyprowadzoną kontrę. Zawodnicy aktualnych mistrzów naszej ligi drużyny Szkoły Języków Obcych Complex szybko ruszyli do odrabiania strat niestety ponownie nadziali się na mistrzowską kontrę , którą skutecznie wykończył Maciej Kusznir w 10 minucie. Potem zawodnicy drużyny Koko Bis mieli jeszcze jedną wspaniałą sytuację której nie wykorzystali. W tym momencie zawodnicy Complexu byli nieco zagubieni.Grali niepewnie i bojażliwie ponieważ obawiali się kolejnej kontry i kolejnej straty bramki. Dopiero Michał Kanclerz składnie przeprowadzonej akcji całego zespołu zdobył bramkę kontaktową w 17 minucie meczu. Od tego momentu nowy duch wstąpił w zawodników Complexu , którzy zdecydowanie zaatakowali i zdobyli w 18 minucie wyrównanie za sprawą Dominika Dąbka .Jak się póżniej okazało to nie był koniec emocji w tym meczu. Prowadzenie dla drużyny Complexu bardzo ładnym strzałem zdobył nowy jej zawodnik Michał Zając ( bardzo dobre wprowadzenie do zespołu) w 22 minucie gry. Stan meczu wyrównał pięknym strzałem Tomasz Witkowski. W tym czasie Complex grał osłabiony ponieważ czerwoną kartkęotrzymał Wiktor Urbańczyk ( akcja ratunkowa).Gdy wszystkim się wydawało , że spotkanie zakończy się podziałem punktów Piotr Deryniowski był faulowany w polu karnym w wyniku czego sędzia spotkania Rafał Ziach odgwizdał rzut karny dla drużyny Complex. Skutecznym wykonawcą okazał się Michał Kanclerz na 37 sekund przed końcem meczu.Końcówka to zdecydowany atak drużyny Koko Bis , przejęcie piłki przez zawodników Complex i skuteczne wykończenie akcji równo z syreną. Końcowy wynik 5:3 dla Szkoły Języków Obcych Complex.Był to mecz potwierdzający wysokie umiejętności zawodników obu drużyn i zapowiadający ciekawą walkę w naszej lidze w tym sezonie.\r\n\r\n\r\n \r\n', 'Kaprin, Futsal, LeagueTym, sensacji, poniedziałkowych, meczach, Kaprin, Futsal, League W, pierwszym, pomiędzy, drużynami, System, Morawica, zespoły, wystąpiły, osłabionych, składachW, sytuacji, lepiej, poradzili, bardzo, doświadczeni, ograni, ligach, futsalowych, zawodnicy, zawodnicy, StopDo, przerwy, trwała, wyrównana, Pierwsi, bramkę, zdobyli, zawodnicy, Morawica, szybko, odpowiedzieli, odpowiedzieli, zawodnicy, System, doprowadzając, wyrównania, kolejne, sytuacje, zdobycia, prowadzenia, Niestety, niewykorzystane, sytuacje, zwykle, mszczą, albowiem, pierwsi, jeszcze, pierwszej, połowie, zdobyli, prowadzenie, którego, póżniej, okazało, oddali, końcaW, drugiej, połowie, zawodnicy, Morawica, zdobyli, jeszcze, jeszcze, bramek, tracąc, jedną, Końcowy, spotkania, Morawica, Drużyna, System, wysokiej, porażki, zasłużyła, słowa, uznania, otwarty, ambicje, umiejętności, piłkarskie, Martwi, jednak, skuteczności, spowodowało, różnica, bramkach, dobrej, gryBramki:, Mroziński, Sawczuk, StopZdziech, Grochal, SystemW, drugim, licznie, zgromadzeni, trybunach, kibice, czekali, kolejną, sensację, rozgrywkach, Niestety, okazało, drużyna, zatrzymania, młody, zespół, VitaTylko, początek, mógł, znamionować, sensację, albowiem, minucie, remisowy, Niestety, minuty, bramki, strzelali, zawodnicy, drużyny, Kaprin, pierwszej, połowie, zdobyli, jeszcze, drugiej, dołożyli, jeszcze, efekcie, końcowy, drużyny, KaprinBramki:, Wąchol, Kłeczek, Grzebinoga, 2Stryczek, Nawała, Kaprinu, Jaworski, VitaZgodnie, oczekiwaniami, ostatni, dostarczył, kibicom, niesamowitych, emocji, początku, boisku, trwała, regularna, "piłkarska, wojna", Krótkie, krycie, każdy, bardzo, dokładne, rozgrywanie, piłki, mistrzowski, sposób, wyprowadzania, kontry, zespół, Początek, delikatnie, mówiąc, zaskoczenie, ponieważ, bramki, zdobyli, zawodnicy, drużyny, Pierwszą, bramkę, minucie, zdobył, Tomasz, Witkowski, kończąc, wspaniale, wyprowadzoną, kontrę, Zawodnicy, aktualnych, mistrzów, naszej, drużyny, Szkoły, Języków, Obcych, Complex, szybko, ruszyli, odrabiania, niestety, ponownie, nadziali, mistrzowską, kontrę, którą, skutecznie, wykończył, Maciej, Kusznir, minucie, zawodnicy, drużyny, jeszcze, jedną, wspaniałą, sytuację, której, wykorzystali, momencie, zawodnicy, Complexu, zagubieniGrali, niepewnie, bojażliwie, ponieważ, obawiali, kolejnej, kontry, kolejnej, straty, bramki, Dopiero, Michał, Kanclerz, składnie, przeprowadzonej, całego, zespołu, zdobył, bramkę, kontaktową, minucie, momentu, wstąpił, zawodników, Complexu, którzy, zdecydowanie, zaatakowali, zdobyli, minucie, wyrównanie, sprawą, Dominika, Dąbka, póżniej, okazało, koniec, emocji, Prowadzenie, drużyny, Complexu, bardzo, ładnym, strzałem, zdobył, zawodnik, Michał, Zając, bardzo, wprowadzenie, zespołu), minucie, wyrównał, pięknym, strzałem, Tomasz, Witkowski, czasie, Complex, osłabiony, ponieważ, czerwoną, kartkęotrzymał, Wiktor, Urbańczyk, ratunkowa)Gdy, wszystkim, wydawało, spotkanie, zakończy, podziałem, punktów, Deryniowski, faulowany, karnym, wyniku, sędzia, spotkania, Rafał, odgwizdał, drużyny, Complex, Skutecznym, wykonawcą, okazał, Michał, Kanclerz, sekund, końcem, meczuKońcówka, zdecydowany, drużyny, przejęcie, piłki, zawodników, Complex, skuteczne, wykończenie, równo, syreną, Końcowy, Szkoły, Języków, Obcych, ComplexBył, potwierdzający, wysokie, umiejętności, zawodników, drużyn, zapowiadający, ciekawą, walkę, naszej, sezonie\r\n\r\n\r\n \r\n'),
	(1616, 'pl', 'Międzynarodowy Mikołajkowy Turniej Halowej Piłki Nożnej Dziewcząt w Krzeszowicach 2014.', 'Międzynarodowy Mikołajkowy turniej halowej piłki nożnej dziewcząto Puchar Burmistrza Gminy Krzeszowice 2014.29/30 listopad 2014 r.W turnieju udział bierze 12 drużyn podzielonych na 3 grupy.Grupa I od 9-00 do 11.201. Bronowianka I2.Orawa Team3.Victoria Gaj4. UKS " Jedynka" I/Świt IIGrupa IIod 11.30 do 13.501.Rużemberok I2.As Progres3.LKS Promyk4.UKS " Jedynka "/Świt IUroczyste otwarcie turnieju przez p. Burmistrza Czesława Bartla.Występ artystyczny grupy Harmonia Fitnes.Uroczyste podziękowanie zakładom pracy, firmom i osobom prywatnym- sponsorom UKS " Jedynka" Krzeszowice.Grupa IIIod 14 .40 do 17.101.Rużemberok II2.Naprzód Sobolów3.Bronowianka II4. PrądniczankaW grupach mecze rozgrywamy systemem " każdy z każdym ".Czas gry 2 x 12 minut.W niedzielę 30 grudnia również turniej rozgrywany jest systemem grupowym w/g klucza :Grupa I o miejsca od 9-12Godz. 9.00 -- 11.20 Grają drużyny , które w sobotnich grupach zajmą ostatnie miejsca + drużyna , która zajmie 3 miejsce z najmniejszym dorobkiem punktowym.Grupa II o miejsca od 5 do 8Godz. 11.30-- 13.50Grają drużyny , które w sobotnich grupach zajmą drugie i trzecie miejsca ( najlepszy dorobek punktowy)Grupa III o miejsca od 1 do 4Godz.14.00 -- 16.30Grają drużyny , które w sobotnich grupach zajmą pierwsze miejsca + drużyna z drugiego miejsca z najlepszym dorobkiem punktowym.Godzina 17.00 zakończenie turnieju , wręczenie dyplomów , pucharów dla wszystkich drużyn, medali dla 3 najlepszych drużyn oraz nagród indywidualnych- najlepszy zawodnik, najlepszy bramkarz ,najlepszy strzelecW turnieju obowiązują przepisy futsalowe.W meczu występuje 4 zawodników w polu + bramkarz. Mecze rozgrywane są piłką do futsalu.Ubezpieczenie zawodników we własnym zakresie.Szczegółowy terminarz turnieju zostanie podany w sobotę 22 listopada.informacje pod numerem 696459906', 'Międzynarodowy, Mikołajkowy, turniej, halowej, piłki, nożnej, dziewcząto, Puchar, Burmistrza, Krzeszowice, 20142930, listopad, turnieju, udział, bierze, drużyn, podzielonych, grupyGrupa, Bronowianka, I2Orawa, Team3Victoria, Jedynka", IŚwit, IIGrupa, 13501Rużemberok, Progres3LKS, Promyk4UKS, Jedynka, "Świt, IUroczyste, otwarcie, turnieju, Burmistrza, Czesława, BartlaWystęp, artystyczny, Harmonia, FitnesUroczyste, podziękowanie, zakładom, firmom, osobom, prywatnym, sponsorom, Jedynka", KrzeszowiceGrupa, 17101Rużemberok, II2Naprzód, Sobolów3Bronowianka, PrądniczankaW, grupach, rozgrywamy, systemem, każdy, każdym, minutW, niedzielę, grudnia, również, turniej, rozgrywany, systemem, grupowym, klucza, :Grupa, miejsca, 912Godz, 1120 Grają, drużyny, które, sobotnich, grupach, zajmą, ostatnie, miejsca, drużyna, która, zajmie, miejsce, najmniejszym, dorobkiem, punktowymGrupa, miejsca, 1350Grają, drużyny, które, sobotnich, grupach, zajmą, drugie, trzecie, miejsca (, najlepszy, dorobek, punktowy)Grupa, miejsca, 4Godz1400, 1630Grają, drużyny, które, sobotnich, grupach, zajmą, pierwsze, miejsca, drużyna, drugiego, miejsca, najlepszym, dorobkiem, punktowymGodzina, zakończenie, turnieju, wręczenie, dyplomów, pucharów, wszystkich, drużyn, medali, najlepszych, drużyn, nagród, indywidualnych, najlepszy, zawodnik, najlepszy, bramkarz, najlepszy, strzelecW, turnieju, obowiązują, przepisy, futsaloweW, występuje, zawodników, bramkarz Mecze, rozgrywane, piłką, futsaluUbezpieczenie, zawodników, własnym, zakresieSzczegółowy, terminarz, turnieju, zostanie, podany, sobotę, listopadainformacje, numerem, 696459906'),
	(1617, 'pl', 'Kaprin Futsal League', 'Kłosowski nie pomógł ,Archidraft pokonał kolejnego faworyta.....Szkoła Języków Obcych Complex najlepsza, po 4 kolejkach....Koko Bis pewnie gra i wysoko wygrywa.....Auto Stop w czterech wygrywa z Ren Polem...\r\nNa drodze rozpędzonej drużynie Archidraft stanął kolejny faworyt ligi brązowi medaliści poprzedniego sezonu drużyna Kaprin. Według kibiców to właśnie Kaprin był faworytem tego spotkania. Początek tego spotkania zdał się potwierdzać te przypuszczenia albowiem jego zawodnicy po 3 minutach meczu prowadzili już 2:0 po bramkach Kłeczka i Wąchola. Jednak z upływem czasu Archidraft zaczął dochodzić do głosu. w 10 minucie bramkę kontaktową zdobył Drożdżak i pierwsza połowa zakończyła się wynikiem 2:1 dla Kaprinu. Druga połowa to coraz szybsze , płynniejsze akcje wyprowadzali zawodnicy drużyny Archidraft stwarzając spore zamieszanie pod bramką Kłosowskiego . Bramkarz Kaprinu dwoił się i troił , żeby uchronić swój zespół przed utratą kolejnych bramek. Niestety częste błędy w obronie Kaprinu spowodowały , że i bramkarz nie był w stanie wytrzymać tego naporu. Co się nie zdarza często bardzo dobrze broniącemu Kamilowi Kłosowskiemu musiał wyciągać jeszcze 5 ( Sarota 2, Brzuchacz 2, Mirochna 1)razy piłkę z siatki w tym meczu . A ponieważ umiejętności strzeleckie zawodników Kaprinu były w tym dniu na bardzo słabym poziomie - zdobyli jeszcze tylko 1 bramkę( Grzebinoga )- dlatego przegrali to spotkanie 3:6\r\nSzkoła Języków Obcych Complex jak przystało na mistrza pewnie i skutecznie wygrywa swoje mecze zajmując pierwsze miejsce na podium. W dwóch meczach ostatniej kolejki spotkań zawodnicy drużyny Complex zdobył 27 bramek tracąc tylko 6. W pierwszym z nich Complex pokonał Base System 13 : 2 prowadząc do przerwy 4:0. Właściwie był to mecz bez historii ponieważ od początku do końca widoczna była przewaga Complexu nad beniaminkiem ligi drużyną Base System.Bramki: Kanclerz M 6, Deryniowski P 3, Liptak N 2, Wróblewski W 1, Armatys G 1- dla ComplexuSkawiński d 1, Zdziech K 1-- dla Base System.\r\nW drugim zapowiadającym się jako hit kolejki, meczu pomiędzy drużynami Complex i ZSP Krzeszowice ponownie wysokie zwycięstwo odnieśli aktualni mistrzowie ligi pokonując ZSP 14:4. Wynik może być zaskoczeniem dla kibiców drużyny z ZSP ponieważ spodziewali się bardzo dobrego widowiska stojącego na wysokim poziomie. Niestety drużyna ZSP wystąpiła w meczu z mistrzami w bardzo osłabionym składzie co skutkowało tak wysoką ich porażką. Bramki : Wróblewski W 5, Armatys G 4, Kanclerz M 3,Liptak N 2- dla ComplexuKurzański D 3, Wadas D 1.\r\nKoko Bis z meczu na mecz pewniej sobie poczyna prezentując urozmaiconą , szybką i bardzo skuteczną grę. Tym razem mieli teoretycznie łatwiejsze zadanie ponieważ grali z najmłodszą drużyną ligi Dolce Vitą. Jak było do przewidzenia mecz miał jednostronny przebieg. Doświadczenie oraz bardzo dobre umiejętności zawodników Koko Bis pozwoliły na swobodne, pełne finezyjnych zagrań rozgrywanie piłki. Nie można odmówić młodym zawodnikom Dolce Vity ambicji i woli walki jednak widać w jej szeregach doświadczonego zawodnika, który pokierowałby i uspokoił ich grę. Brakuje również u młodzieży skuteczności w wykańczaniu stworzonych przez siebie akcji. Koko Bis to drużyna doświadczona , ograna w licznych turniejach i ligach futsalowych , mająca w swoich szeregach bardzo mocnych zawodników. Bramki:Witkowski T 4, Piskorz P 3, Kozyra M 1,Doległo K 1- Koko BisObodziński J 2-- Dolce Vita.\r\nAuto Stop Morawica przystąpił do meczu z drużyną Ren Pol Sankowia w czteroosobowym składzie . Kibice zastanawiali się na ile sił wystarczy zawodnikom osłabionej drużyny i jakim wynikiem zakończy się to spotkanie. Jak było do przewidzenia zawodnicy Auto Stop rozpoczęli mecz głęboko cofnięci pod własną bramkę czekając na przeprowadzenie szybkiej i skutecznej kontry. Tak też się stało w 4 minucie kiedy podanie przechwycił ł Mateusz Marszałek i po szybkiej kontrze skutecznie zakończył swoją akcję wyprowadzając zespół na prowadzenie.W 9 minucie można powiedzieć powtórka z rozrywki i ponownie Mateusz Marszałek zdobywa 2 bramkę dla swojego zespołu.W 10 minucie bramkę kontaktową zdobył Nowotarski M dając nadzieję na odwrócenie losów meczu.. Przez kilka minut trwało oblężenie bramki Wróbla jednak w 15 minucie kolejny przechwyt piłki zaliczył M Marszałek , dograł do D Mrozińskiego, który podwyższył prowadzenie swojej drużynie.. Niespełna 2 minuty póżniej M Siuda wpakował piłkę do bramki Wróbla dając ponownie kontakt drużynie Ren Polu.Niestety Jednak M Marszałek jeszcze dwa razy skontrował skutecznie powiększając przewagę drużyny Auto Stop do 5:2 na co Ren Pol odpowiedział tylko raz - Bazarnik D- odpowiedzieli kończąc spotkanie wynikiem 5:3 dla drużyny Auto Sto Morawica co przy takim osłabieniu można uznać za niespodziankę dla swoich kibiców', 'Kłosowski, pomógł, Archidraft, pokonał, kolejnego, faworytaSzkoła, Języków, Obcych, Complex, najlepsza, kolejkachKoko, pewnie, wysoko, wygrywaAuto, czterech, wygrywa, Polem\r\nNa, drodze, rozpędzonej, drużynie, Archidraft, stanął, kolejny, faworyt, brązowi, medaliści, poprzedniego, sezonu, drużyna, Kaprin, Według, kibiców, właśnie, Kaprin, faworytem, spotkania, Początek, spotkania, potwierdzać, przypuszczenia, albowiem, zawodnicy, minutach, prowadzili, bramkach, Kłeczka, Wąchola, Jednak, upływem, Archidraft, zaczął, dochodzić, głosu, minucie, bramkę, kontaktową, zdobył, Drożdżak, pierwsza, połowa, zakończyła, wynikiem, Kaprinu, połowa, szybsze, płynniejsze, wyprowadzali, zawodnicy, drużyny, Archidraft, stwarzając, zamieszanie, bramką, Kłosowskiego, Bramkarz, Kaprinu, dwoił, troił, uchronić, zespół, utratą, kolejnych, bramek, Niestety, częste, błędy, obronie, Kaprinu, spowodowały, bramkarz, stanie, wytrzymać, naporu, zdarza, często, bardzo, dobrze, broniącemu, Kamilowi, Kłosowskiemu, musiał, wyciągać, jeszcze, Sarota, Brzuchacz, Mirochna, 1)razy, piłkę, siatki, ponieważ, umiejętności, strzeleckie, zawodników, Kaprinu, bardzo, słabym, poziomie, zdobyli, j