	(1624, 'pl', 'Bronowianka najlepsza', 'W dniach 29-30.11.2014 w Krzeszowicach rozegrany został Międzynarodowy Mikołajkowy turniej futsalu dziewcząt z rocznika 1999 i młodszych. W turnieju wzięło udział 12 drużyn w tym 3 ze Słowacji. Turniej zakończył się zwycięstwem drużyny Bronowianki I przed Naprzodem Sobolów i drużyną MFK Rużemberok I. Najlepszą zawodniczką turnieju została Michaela Buzakova(MFK Rużemberok I), najlepszą bramkarką uznano Klaudie Kurek z Naprzodu Sobolów a najlepszą strzelczynią została Wiktoria Pietrzyk z Bronowianki I\r\nOto komplet wyników:\r\nFaza grupowa\r\n \r\nGrupa 1\r\nUKS Jedynka Krzeszowice II : Bronowianka Kraków I 1:13\r\nVictoria Gaj : Orawa Team 2:3\r\nOrawa Team : Bronowianka I 1:2\r\nVictoria : UKS Jedynka II 7:0\r\nBronowianka I : Victoria 9:3\r\nOrawa Team : UKS Jedynka II 6:2\r\n \r\nGrupa 2\r\nMFK Rużemberok I : AS Progres 7:0\r\nLKS Promyk Bolęcin : UKS Jedynka I 4:2\r\nPromyk : Rużemberok I 0:1\r\nUKS Jedynka I : As Progres 4:0\r\nAs Progres : Promyk 3:2\r\nUKS Jedynka I : Rużemberok I 1:0\r\nGrupa 3\r\nMFK Rużemberok II : Naprzód Sobolów 0:4\r\nBronowianka Kraków II : Prądniczanka 1:2\r\nBronowianka II : Rużemberok II 6:0\r\nPrądniczanka : Naprzód 0:4\r\nNaprzód : Bronowianka II 1:1\r\nPrądniczanka : Rużemberok II 4:0\r\n \r\nFaza finałowa\r\n \r\nGrupa o miejsca 9-12\r\nOrawa Team : UKS Jedynka II 6:2\r\nUKS Jedynka II : AS Progres 3:5\r\nLKS Promyk Bolęcin : MFK Rużemberok I 1:0\r\nUKS Jedynka II :  Promyk 0:1\r\nProgres : Rużemberok I 1:2\r\nUKS Jedynka II :  Rużemberok I 0:1\r\nAS Progres : Promyk 1:2\r\n \r\nGrupa o miejsca 5-8\r\nVictoria Gaj : Prądniczanka Kraków 5:0\r\nOrawa Team : Bronowianka Kraków II 3:0\r\nVictoria : Orawa Team 2:4\r\nPrądniczanka : Bronowianka II 3:2\r\nVictoria Gaj : Bronowianka II 7:3\r\nPrądniczanka : Orawa Team 0:3\r\n \r\nGrupa o miejsca 1-4\r\nUKS Jedynka I : MFK Rużemberok I 0:2\r\nBronowianka I :  Naprzód 3:2\r\nUKS Jedynka I : Bronowianka 0:7\r\nRużemberok I : Naprzód 1:2\r\nUKS Jedynk