	(1625, 'pl', 'Kaprin Futsal League odwołana', 'Uwaga Uwaga jutro na hali sportowej przy Gimnazjum będzie wymiana oświetlenia w związku z powyższym nie ma treningu o 14.30 jak również meczów Kaprin Futsal League. Jutrzejsze mecze Kaprin Futsal League odwołane ze względu na wymianę oświetlenia. Proszę o powiadomienie wszystkich zawodników z drużyny.', 'sportowej, Gimnazjum, będzie, wymiana, oświetlenia, związku, powyższym, treningu, również, meczów, Kaprin, Futsal, League, Jutrzejsze, Kaprin, Futsal, League, odwołane, względu, wymianę, oświetlenia, Proszę, powiadomienie, wszystkich, zawodników, drużyny'),
	(1626, 'pl', 'Międzynarodowy mikołajkowy turniej halowej piłki nożnej dziewcząt U- 15 oraz mikołajkowy turniej U- 17', 'Turniej mikołajkowy w Krzeszowicach 2014.Udział wzięło 17 drużyn z kraju i 3 drużyny ze Słowacji . Bardzo wysoki poziom rywalizacji, kontakt z drużynami z najwyższej półki.Nasz dorobek to 4 miejsce w kategorii U-15 oraz 2 miejsce w kategorii U-17.Wspaniały wynik jak na 3 lata treningów. A więc uśmiech na twarzy, głowy do góry i trenujemy dalej. Przed nami liga regionalna, turniej Walentynkowy na Prądniczance, oraz turniej seniorek w Krzeszowicach.', 'Turniej, mikołajkowy, Krzeszowicach, 2014Udział, wzięło, drużyn, drużyny, Słowacji,  Bardzo, wysoki, poziom, rywalizacji, kontakt, drużynami, najwyższej, półkiNasz, dorobek, miejsce, kategorii, miejsce, kategorii, U17Wspaniały, treningów, uśmiech, twarzy, głowy, trenujemy, regionalna, turniej, Walentynkowy, Prądniczance, turniej, seniorek, Krzeszowicach'),
	(1627, 'pl', 'Międzynarodowy mikołajkowy turniej halowej piłki nożnej dziewcząt U- 15 Krzeszowice 2014 .', 'Międzynarodowy mikołajkowy turniej halowej piłki nożnej dziewcząt U- 15 Krzeszowice 2014 .Udział w turnieju wzięło 12 drużyn w tym wielokrotne mistrzynie Polski w kategoriach młodzieżowych Naprzód Sobolów i Bronowianka Kraków, trzy drużyny ze Słowacji - Orawa Team oraz Rużemberok I i Rużemberok II. Razem około 120 zawodniczek w kategorii U - 15.Nasze dziewczyny o krok za mistrzyniami Polski.Tym razem mamy czwarte miejsce w turnieju wywalczone po wspaniałej walce pełnej ambicji i zadziorności . Czwarte miejsce w tak mocno obsadzonym turnieju jest dla nas ogromnym sukcesem. Trenujemy razem od niespełna 3 lat a jesteśmy tuż za mistrzyniami ( Bronowianka i Naprzód Sobolów to wielokrotni mistrzowie Polski w różnych kategoriach młodzieżowych ). Brawo dziewczyny jesteście wspaniałe.W dniach 29-30.11.2014 w Krzeszowicach rozegrany został Międzynarodowy Mikołajkowy turniej futsalu dziewcząt z rocznika 1999 i młodszych. W turnieju wzięło udział 12 drużyn w tym 3 ze Słowacji. Turniej zakończył się zwycięstwem drużyny Bronowianki I przed Naprzodem Sobolów i drużyną MFK Rużemberok I. Najlepszą zawodniczką turnieju została Michaela Buzakova(MFK Rużemberok I), najlepszą bramkarką uznano Klaudie Kurek z Naprzodu Sobolów a najlepszą strzelczynią została Wiktoria Pietrzyk z Bronowianki IOto komplet wyników: Faza grupowaGrupa 1 UKS Jedynka Krzeszowice II : Bronowianka Kraków I 1:13Victoria Gaj : Orawa Team 2:3Orawa Team : Bronowianka I 1:2Victoria : UKS Jedynka II 7:0Bronowianka I : Victoria 9:3Orawa Team : UKS Jedynka II 6:2Grupa 2MFK Rużemberok I : AS Progres 7:0LKS Promyk Bolęcin : UKS Jedynka I 4:2Promyk : Rużemberok I 0:1UKS Jedynka I : As Progres 4:0As Progres : Promyk 3:2UKS Jedynka I : Rużemberok I 1:0Grupa 3MFK Rużemberok II : Naprzód Sobolów 0:4Bronowianka Kraków II : Prądniczanka 1:2Bronowianka II : Rużemberok II 6:0Prądniczanka : Naprzód 0:4Naprzód : Bronowianka II 