	(1630, 'pl', 'Szczęśliwego Nowego 2015 roku.', '"Fajerwerki, śnieg, muzyka, już szampana każdy łyka! Stary rok się w Nowy zmienia, przeto szczęścia ślę życzenia .Kiedy Nowy Rok nadchodzi, kieliszeczek nie zaszkodzi, kufel piwa to za mało, litr szampana by się zdało. Trzeba opić wszystkie troski, by następny rok był boski. SZCZĘŚLIWEGO NOWEGO ROKU!".', '"Fajerwerki, śnieg, muzyka, szampana, każdy, zmienia, przeto, szczęścia, życzenia, nadchodzi, kieliszeczek, zaszkodzi, szampana, zdało, Trzeba, wszystkie, troski, następny, SZCZĘŚLIWEGO, NOWEGO'),
