	(1632, 'pl', 'Turniej mikołajkowy U- 97 Krzeszowice 2014 ', 'Jesteśmy coraz bliżej mistrzostwa.II miejsce i srebrne medale to dorobek naszych dziewcząt w kategorii u- 17. Do złota mamy coraz bliżej.1. Lks Szaflary 2. UKS Jedynka"/ śWIT kRZESZOWICE3. ex aequo As Progres Prądniczanka Kraków.II 5. Prądniczanka Kraków I6.Naprzód Sobolów 7. MKS ZWM Wodna Trzebinia8. UKS " Jedynka"/Świt KrzeszowiceTakich emocji dawno nie bylo.Najlepsza zawodniczka Julia Łoboz to dorobek naszych zawodniczek.', 'Jesteśmy, bliżej, mistrzostwaII, miejsce, srebrne, medale, dorobek, naszych, dziewcząt, kategorii, złota, bliżej1, Szaflary 2, Jedynka", kRZESZOWICE3, Progres Prądniczanka, KrakówII 5, Prądniczanka, Kraków, I6Naprzód, Sobolów 7, Trzebinia8, Jedynka"Świt, KrzeszowiceTakich, emocji, byloNajlepsza, zawodniczka, Łoboz, dorobek, naszych, zawodniczek'),
	(1633, 'pl', 'Puchar  Kaprin Futsal League', 'Uwaga podaję propozycję rozegrania Pucharu Ligi.\r\nTermin - do ustalenia.Uczestnicy Kaprin Futsal League- 9 drużyn podzielonych na 3 grupy według rankingu.System rozgrywek - w grupach " każdy z każdym", następnie drużyny , które zajmą 3 miejsca w grupach grają między sobą o miejsca 7-9 w turnieju. Drużyny z 2 miejsc w grupach eliminacyjnych grają między sobą o miejsca 4-6 a drużyny z pierwszych miejsc w grupach grają między sobą o miejsca 1-3 w turnieju.Koszt turnieju 150 zł od drużyny ( puchary, sędziowie, napoje i opata za wynajem hali)Bardzo proszę o potwierdzanie drużyn w turnieju. Termin zostanie ustalony po konsultacjach z zainteresowanymi drużynami.', 'podaję, propozycję, rozegrania, Pucharu, Ligi\r\nTermin, ustaleniaUczestnicy, Kaprin, Futsal, League, drużyn, podzielonych, według, rankinguSystem, rozgrywek, grupach, każdy, każdym", następnie, drużyny, które, zajmą, miejsca, grupach, grają, między, miejsca, turnieju, Drużyny, miejsc, grupach, eliminacyjnych, grają, między, miejsca, drużyny, pierwszych, miejsc, grupach, grają, między, miejsca, turniejuKoszt, turnieju, drużyny, puchary, sędziowie, napoje, wynajem, hali)Bardzo, proszę, potwierdzanie, drużyn, turnieju, Termin, zostanie, ustalony, konsultacjach, zainteresowanymi, drużynami'),
	(1634, 'pl', 'Juniorki młodsze UKS" Jedynka"/Świt w II rundzie  Halowych Mistrzostwach Małopolski piłki nożnej dziewcząt', 'Nasze dziewczyny wywalczyły awans do następnej rundy Halowych Mistrzostw Małopolski w piłce nożnej juniorek młodszych.3 zwycięstwa , jedna porażka i co najważniejsze II miejsce w turnieju premiowane awansem do następnej rundy. Jest coraz lepiej . Ogromne brawa dziewczyny.Wyniki naszej drużyny :1.UKS" Jedynka" /Świt Krzeszowice : Zielonka Wrząsowice 1: 0Bramka Kubica Kornelia2.UKS" Jedynka" /Świt Krzeszowice : Victoria Gaj 3:2Bramki dla naszej drużyny: Janowska Ewa 1, Łoboz Julia 1, Byczek Agata 1dla Victorii Gaj Sonia Jurka 23.UKS" Jedynka" /Świt Krzeszowice : Bronowianka 4:5Bramki dla naszej drużyny : Janowska Ewa 2, Łoboz Julia 1, Kubica Kornelia 1dla Bronowianki : Latka Kinga 3, Staszczak Anna 1, Biel Anna 14.UKS" Jedynka" /Świt Krzeszowice : Triumf Alwernia 2:1Bramki dla naszej drużyny: Janowska Ewa 2dla drużyny Triumf Alwernia Kapcia Joanna 1\r\n\r\nSkład naszej drużyny:Sroka Weronika, Byczek Agata, Kubica Kornelia, Oracz Klaudia, Łoboz Julia, Janowska Ewa, Skotniczna Katarzyna, Walczowska Zuzanna, Dziwak Klaudia.\r\n', 'dziewczyny, wywalczyły, następnej, Halowych, Mistrzostw, Małopolski, piłce, nożnej, juniorek, młodszych3, zwycięstwa, porażka, najważniejsze, miejsce, turnieju, premiowane, awansem, następnej, lepiej, Ogromne, dziewczynyWyniki, naszej, drużyny, :1UKS", Jedynka", Krzeszowice, Zielonka, Wrząsowice, 0Bramka, Kubica, Kornelia2UKS", Jedynka", Krzeszowice, Victoria, 3:2Bramki, naszej, drużyny:, Janowska, Łoboz, Byczek, Victorii, 23UKS", Jedynka", Krzeszowice, Bronowianka, 4:5Bramki, naszej, drużyny, Janowska, Łoboz, Kubica, Kornelia, Bronowianki, Staszczak, 14UKS", Jedynka", Krzeszowice, Triumf, Alwernia, 2:1Bramki, naszej, drużyny:, Janowska, drużyny, Triumf, Alwernia, Kapcia, Joanna, 1\r\n\r\nSkład, naszej, drużyny:Sroka, Weronika, Byczek, Kubica, Kornelia, Klaudia, Łoboz, Janowska, Skotniczna, Katarzyna, Walczowska, Zuzanna, Dziwak, Klaudia\r\n'),
	(1635, 'pl', 'Koko Bis nowym liderem KFL', 'Koko Bis po zwycięstwie w ostatniej kolejce Kaprin Futsal League 4:3 nad aktualnym mistrzem drużyną Complex został nowym liderem rozgrywek na 5 kolejek przed końcem sezonu. Mecz był bardzo wyrównany i stał na wysokim poziomie. Losy spotkania ważyły się do ostatnich mint meczu. W końcówce mogła i powinna paść bramka wyrównująca dla Complexu ale strzał z  kilku metrów obronił instynktownie jeden z obrońców drużyny Koko Bis. W pierwszym meczu pomiędzy tymi drużynami wygrała drużyna Complex 5:3. Końcówka sezonu zapowiada się bardzo emocjonująco ponieważ do tytułu mistrzowskiego w dalszym ciągu pretenduje 5 drużyn.', 'zwycięstwie, ostatniej, kolejce, Kaprin, Futsal, League, aktualnym, mistrzem, drużyną, Complex, został, liderem, rozgrywek, kolejek, końcem, sezonu, bardzo, wyrównany, wysokim, poziomie, spotkania, ważyły, ostatnich, końcówce, mogła, powinna, paść, bramka, wyrównująca, Complexu, strzał,  kilku, metrów, obronił, instynktownie, obrońców, drużyny, pierwszym, pomiędzy, drużynami, wygrała, drużyna, Complex, Końcówka, sezonu, zapowiada, bardzo, emocjonująco, ponieważ, tytułu, mistrzowskiego, dalszym, ciągu, pretenduje, drużyn'),
	(1636, 'pl', 'Auto Stop Morawica- Number One', 'Auto Stop Morawica number one .........Base System Remisuje z Koko Bis.........Dolce Vita coraz lepiej ale na wicemistrzów ciągle za mało......\r\nW ostatniej kolejce Kaprin Futsal League Koko Bis wygrało z aktualnym mistrzem drużyną Szkoły Języków Obcych 4:3 i objęło prowadzenie w rozgrywkach . Auto Stop Morawica zajmowało przed poniedziałkowym meczem 4 miejsce ze stratą tylko 3 pkt do Koko Bis. Można było się więc spodziewać , że pojedynek obu drużyn będzie bardzo zacięty i będzie miało duży ciężar gatunkowy. Tak też się stało. Oba zespoły zagrały na bardzo wysokim poziomie, prezentując nieprzeciętne umiejętności piłkarskie. Pierwsze 7 minut trwała zacięta walka na całej długości i szerokości boiska. Każdy z zawodników miał swojego " plastra "od którego ciężko było się uwolnić . Obie drużyny grały bardzo rozważnie , żeby nie popełnić błędu. W swoich strefach obronnych zawodnicy grali bardzo agresywnie nie dopuszczając swoich przeciwników do sytuacji strzeleckich. Pierwszą skuteczną akcję wyprowadzili zawodnicy Auto Stop Morawica w 7 min po przejęciu piłki w swoje strefie obronnej, zagraniu na prawe skrzydło do Pawła Sawczuka, który z pierwszej piłki zagrał na dalszy słupek bramki skąd strzałem wykończył Tomasz Kmiecik. W dalszym ciągu trwała walka na całym boisku. Akcje zmieniały się jak w kalejdoskopie. Oglądaliśmy dużo gry z pierwszej piłki, strzałów i efektownych parad bramkarskich po obu stronach. 17 minucie gry Daniel Mroziński był faulowany w polu karnym Koko Bis i sędzia wskazał na rzut karny. Skutecznym egzekutorem okazał się Dariusz Molik, który podwyższył wynik spotkania na 2:0.Pierwsza połowa zakończyła się takim wynikiem. Podrażnieni takim obrotem sprawy Trzebinianie zaatakowali od II połowy z większym rozmachem chcąc szybko zmniejszyć prowadzenie drużyny Auto Stop. Niestety bardzo dobrze grała obrona srebrnych medalistów poprzedniego sezonu , która nie dopuszczała ich do pozycji strzeleckich. W 24 minucie nastąpiła ponowna kontra drużyny Auto Stop , którą skutecznie zakończył Tomasz Kmiecik. W tym momencie wszyscy myśleli , że już jest po meczu kiedy najskuteczniejszy zawodnik Koko Bis Paweł Piskosz w swoim stylu wymanewrował obronę przeciwników i zdobył pierwszą bramkę dla Koko Bis w 25 minucie meczu . Po zdobyciu gola Trzebinianie ruszyli do odrabiania strat stwarzając sytuacje strzeleckie pod bramką Tomasza Wróbla. Gdy wydawało się , że bramka dla Koko Bis wisi w powietrzu kardynalny błąd popełnił jeden z ich obrońców , który zaczął się kiwać . Paweł Sawczuk wykorzystał sytuację odebrał piłkę obrońcy i dograł do Mateusza Marszałka , który podwyższył wynik na 4:1. Wtedy sprawę w swoje ręce wziął Tomasz Witkowski - jeden z najlepszych zawodników Koko Bis przeprowadził dwie bardzo ładne akcje w których zakręcił obroną Auto Stopu i wywalczył rzut karny. Następnie sam skutecznie go wykonał w 37 min. .Potem jednak szczęście się od niego odwróciło ponieważ zaraz strzelał drugiego karnego przedłużonego i spudłował. W 39 minucie kolejny rzut karny przedłużony dla drużyny Koko Bis i obrona Tomasza Wróbla.Końcowy wynik 4:2 dla Auto Stop Morawica i zmiana lidera . Auto Stop Morawica jest number one.Mnie osobiście podczas tego meczu przypomniały się wspaniałe czasy kiedy w Krzeszowicach grała w Polskiej Ekstraklasie Futsalu drużyna Gaszyńskich.Takich meczów jak ten pomiędzy Auto Stop Morawica i Koko Bis chciało by się oglądać więcej bo naprawdę jest na co patrzyć.\r\nW drugim swoim meczu Auto Stop pewnie pokonał drużynę Dolce Vita 9:2.Mimo porażki młodzi zawodnicy Dolce Vity nie muszą się wstydzić gdyż zagrali kolejne bardzo dobre spotkanie jednak na wicemistrzów poprzedniego sezonu to ciągle za mało.\r\nRemis drużyny Base System z Koko Bis 4:4 w 10 minucie meczu był sporym zaskoczeniem dla kibiców i samych zawodników z Trzebini. Jednak jak się póżniej okazało to było tylko 10 minut słabości Koko Bis. O następnych 30 minutach młodzi zawodnicy Base System chcieliby jak najszybciej zapomnieć. Stracili bowiem w tym czasie 14 bramek nie strzelając żadnej. Mecz zakończył się wynikiem 18:4 dla drużyny Koko Bis.', 'Morawica, number, System, Remisuje, BisDolce, lepiej, wicemistrzów, ciągle, mało\r\nW, ostatniej, kolejce, Kaprin, Futsal, League, wygrało, aktualnym, mistrzem, drużyną, Szkoły, Języków, Obcych, objęło, prowadzenie, rozgrywkach, Morawica, zajmowało, poniedziałkowym, meczem, miejsce, stratą, Można, spodziewać, pojedynek, drużyn, będzie, bardzo, zacięty, będzie, miało, ciężar, gatunkowy, stało, zespoły, zagrały, bardzo, wysokim, poziomie, prezentując, nieprzeciętne, umiejętności, piłkarskie, Pierwsze, trwała, zacięta, całej, długości, szerokości, boiska, Każdy, zawodników, swojego, plastra, którego, ciężko, uwolnić, drużyny, grały, bardzo, rozważnie, popełnić, błędu, swoich, strefach, obronnych, zawodnicy, bardzo, agresywnie, dopuszczając, swoich, przeciwników, sytuacji, strzeleckich, Pierwszą, skuteczną, akcję, wyprowadzili, zawodnicy, Morawica, przejęciu, piłki, strefie, obronnej, zagraniu, skrzydło, Pawła, Sawczuka, który, pierwszej, piłki, zagrał, dalszy, słupek, bramki, strzałem, wykończył, Tomasz, Kmiecik, dalszym, ciągu, trwała, całym, boisku, zmieniały, kalejdoskopie, Oglądaliśmy, pierwszej, piłki, strzałów, efektownych, bramkarskich, stronach, minucie, Daniel, Mroziński, faulowany, karnym, sędzia, wskazał, Skutecznym, egzekutorem, okazał, Dariusz, który, podwyższył, spotkania, 2:0Pierwsza, połowa, zakończyła, wynikiem, Podrażnieni, obrotem, sprawy, Trzebinianie, zaatakowali, połowy, większym, rozmachem, chcąc, szybko, zmniejszyć, prowadzenie, drużyny, Niestety, bardzo, dobrze, grała, obrona, srebrnych, medalistów, poprzedniego, sezonu, która, dopuszczała, pozycji, strzeleckich, minucie, nastąpiła, ponowna, kontra, drużyny, którą, skutecznie, zakończył, Tomasz, Kmiecik, momencie, wszyscy, myśleli, najskuteczniejszy, zawodnik, Paweł, Piskosz, wymanewrował, obronę, przeciwników, zdobył, pierwszą, bramkę, minucie, zdobyciu, Trzebinianie, ruszyli, odrabiania, stwarzając, sytuacje, strzeleckie, bramką, Tomasza, Wróbla, wydawało, bramka, powietrzu, kardynalny, błąd, popełnił, obrońców, który, zaczął, kiwać, Paweł, Sawczuk, wykorzystał, sytuację, odebrał, piłkę, obrońcy, dograł, Mateusza, Marszałka, który, podwyższył, sprawę, wziął, Tomasz, Witkowski, najlepszych, zawodników, przeprowadził, bardzo, ładne, których, zakręcił, obroną, wywalczył, Następnie, skutecznie, wykonał, jednak, szczęście, odwróciło, ponieważ, strzelał, drugiego, karnego, przedłużonego, spudłował, minucie, kolejny, przedłużony, drużyny, obrona, Tomasza, WróblaKońcowy, Morawica, zmiana, lidera, Morawica, number, oneMnie, osobiście, podczas, przypomniały, wspaniałe, Krzeszowicach, grała, Polskiej, Ekstraklasie, Futsalu, drużyna, GaszyńskichTakich, meczów, pomiędzy, Morawica, chciało, oglądać, więcej, naprawdę, patrzyć\r\nW, drugim, pewnie, pokonał, drużynę, 9:2Mimo, porażki, młodzi, zawodnicy, muszą, wstydzić, zagrali, kolejne, bardzo, spotkanie, jednak, wicemistrzów, poprzedniego, sezonu, ciągle, mało\r\nRemis, drużyny, System, minucie, sporym, zaskoczeniem, kibiców, samych, zawodników, Trzebini, Jednak, póżniej, okazało, słabości, następnych, minutach, młodzi, zawodnicy, System, chcieliby, najszybciej, zapomnieć, Stracili, bowiem, czasie, bramek, strzelając, żadnej, zakończył, wynikiem, drużyny'),
