INSERT INTO `league_cup` (`id`, `name`, `slug`, `description`, `photo_root_id`, `metatag_id`) VALUES
	(1, 'Turniej oldbojów 2005', 'turniej-oldbojow-2005', '<p> 5.11.05 odbyl sie na hali w Krzeszowicach Turniej\r\nHalowej Pilki Noznej Oldbojow. Oto wyniki:</p>\r\n<p>Grupa A </p>\r\n<p>Pyszne : ZHH 1 UNIHUT 8:2</p>\r\n<p>ZHH 1 UNIHUT : KWC Czatkowice 6:0</p>\r\n<p>Pyszne : KWC Czatkowice 6:3 </p>\r\n<p>1 miejsce Pyszne 2 6 14:5</p>\r\n<p>2 miejsce ZHH 1 UNIHUT 2 3 8:8</p>\r\n<p>3 miejsce KWC Czatkowice 2 0 3:12</p>\r\n<p>Grupa B</p>\r\n<p>ZHH 2 UNIHUT : Eden 2:3 </p>\r\n<p>Zywiec : Wegrzce 8:1 </p>\r\n<p>Eden : Wegrzce 10:2</p>\r\n<p>Zywiec : ZHH 2 UNIHUT 2:3</p>\r\n<p>ZHH 2 UNIHUT : Wegrzce 6:2</p>\r\n<p>Zywiec : Eden 1:4</p>\r\n<p>1 miejsce Eden 3 9 17:5</p>\r\n<p>2 miejsce ZHH 2 UNIHUT 3 6 11:7</p>\r\n<p>3 miejsce Zywiec 3 3 11:8</p>\r\n<p>4 miejsce Wegrzce 3 0 5:24</p>\r\n<p> Polfinaly :</p>\r\n<p> ZHH 2 UNIHUT : Pyszne 2:2 karne 0:2</p>\r\n<p> ZHH 1 UNIHUT : Eden 2:1</p>\r\n<p>Mecz o 3 miejsce </p>\r\n<p>ZHH 2 UNIHUT : Eden 3:7</p>\r\n<p>FINAL</p>\r\n<p>Pyszne : ZHH 1 UNIHUT 0:9</p>\r\n<p>Krolem strzelcow zostal Artur Kardas , najlepszym\r\nzawodnikiem Grzegorz Socha a bramkarzem Bogusław Szewczyk</p>\r\n<p>Zdjecia z turnieju mozna znalezc w galerii</p>', NULL, NULL),
	(2, 'Turniej międzynarodowy 2005', 'turniej-miedzynarodowy-2005', '<p>27.02.05r. na hali w Krzeszowicach odbyl sie\r\nMiedzynarodowy Turniej Halowej Pilki Nożnej</p>\r\n<p>W turnieju zwyciezyla druzyna Bratanki i Przyjaciele\r\nprzed zespolem Zilmexu</p>\r\n<p>Królem strzelcow z dorobkiem 16 goli zostal Marcin\r\nPituła z Zilmexu</p>\r\n<p>Najlepszym bramkarzem wybrano Dominika Trusniewskiego z\r\nekipy Bratanki i przyjaciele</p>\r\n<p>Klasyfikacja końcowa:</p>\r\n<p>1.Bratanki i Przyjaciele</p>\r\n<p>2.Zilmex</p>\r\n<p>3.Kazimierza Wielka</p>\r\n<p>4.Pyszne</p>\r\n<p>5.Żywiec</p>\r\n<p>6.Cracow United</p>\r\n<p>7.Truskawkowa 4</p>\r\n<p>8.Pepsi</p>', NULL, NULL),
	(3, 'Turniej siatkówki 2005', 'turniej-siatkowki-2005', '<p> W\r\ndniu 22.10.2005roku odbyl sie turniej piłki siatkowej dziewcząt na hali\r\nGimnazjum w Krzeszowicach</p>\r\n<p>Startowalo\r\n6 zespolow. Mecze rozgrywano systemem "każdy z każdym"</p>\r\n<p>Oto\r\nwyniki turnieju :</p>\r\n<p> I\r\nMIEJSCE - Biała Gwiazda - 5 pkt</p>\r\n<p>II\r\nMIEJSCE - Klik - 4 pkt</p>\r\n<p>III\r\nMIEJSCE - Zolwiki - 3 pkt </p>\r\n<p>IV\r\nMIEJSCE - Ziomki-Poziomki - 2 pkt </p>\r\n<p>V\r\nMIEJSCE - Gwiazdki - 1 pkt </p>\r\n<p>VI\r\nMIEJSCE - Atomówki - 0 pkt </p>\r\n<p>Oto\r\nskład zwyciezkiej drużyny :</p>\r\n<p>DOMINIKA\r\nKUCINSKA </p>\r\n<p>KATARZYNA\r\nMOSZ </p>\r\n<p>JUSTYNA\r\nPIGAN </p>\r\n<p>MALGORZATA\r\nGWIZDALA</p>\r\n<p>ALEKSANDRA\r\nPIEKARZ </p>\r\n<p>MAGDALENA\r\nKIJOWSKA </p>\r\n<p> Wszystkim\r\nzwycieżczynią serdecznie gratulujemy </p>\r\n', NULL, NULL),
	(4, 'Turniej integracyjny 2005', 'turniej-integracyjny-2005', '<p> Dnia 10.12.2005r. na hali w Krzeszowicach odbyl sie I\r\nTurniej Integracyjny</p>\r\n<p> Na poczatku zagraly miedzy soba firmy sponsorskie UKS-u\r\n: KWC Czatkowice , Kopalnia Porfiru i Diabazu oraz Eden</p>\r\n<p> Najlepsi okazali sie ci ostatni</p>\r\n<p> Pozniej odbyl sie mecz koszykowki osob\r\nniepelnosprawnych na wozkach oraz pokaz tanca towarzyskiego na wozkach</p>\r\n<p> Nastepnie odbylo sie pokonywanie przeszkod\r\narchitektonicznych przez osoby niepelnosprawne na wozkach</p>\r\n<p> Pozniej na hali odbyl sie pokaz brazyliskiej sztuki\r\nwalki Capoeira\r\noraz wystep cheerliderek z lokalnych szkol oraz pokaz breakdance\'a</p>\r\n<p> Na zakonczenie odbyl sie turniej Aktorzy , Oldboje ,\r\nzwyciezca 1 turnieju firm sponsorskich UKS-u</p>\r\n<p> W tym turnieju po zacietej walce zwyciezyli Oldboje</p>\r\n<p> Na I Turnieju Integracyjnym bylo obecne wiele mediow.\r\nTylko organizatorzy sie martwia ,ze publicznosc nie dopisala  </p>', NULL, NULL),
	(5, 'Turniej noworoczny 2005', 'turniej-noworoczny-2005', '<p>Uczniowski Klub Sportowy "Jedynka" przy Gimnazjum w\r\nKrzeszowicach\r\nzorganizował Noworoczny Turniej halowej pilki noznej juniorow młodszych\r\n</p>\r\n<p>W turnieju udzial wziely nastepujace druzyny : Grajpek\r\nGrajow, Prokocim Krakow, Garbarnia Krakow, Skawinka Skawina oraz 2\r\ndruzyny UKS Świt Krzeszowice </p>\r\n<p>A oto wyniki : </p>\r\n<p><u>UKS Świt II : Grajpek 4:2 </u></p>\r\n<p>Kuflik 2 | Debowski 1 </p>\r\n<p>Bala 1 | Kasprzyk 1 </p>\r\n<p>Gregorczyk 1 </p>\r\n<p><u>UKS Świt I : Prokocim 3:0 </u></p>\r\n<p>Nowotarski 1 </p>\r\n<p>Marszalek 1 </p>\r\n<p>Mucha A 1 </p>\r\n<p><u>Garbarnia : Skawinka 3:1 </u></p>\r\n<p>Dobrucki 2 | Sekula 1 </p>\r\n<p>Cebula 1 </p>\r\n<p><u>UKS Świt I : UKS Świt II 8:1 </u></p>\r\n<p>Sarota 2 | Stepien D 1 </p>\r\n<p>Biga 1 </p>\r\n<p>Marszalek 2 </p>\r\n<p>Funek 1 </p>\r\n<p>Mucha A 2 </p>\r\n<p><u>Garbarnia : Grajpek 4:1 </u></p>\r\n<p>Bryndza 2 | Mietniowski 1 </p>\r\n<p>Janka 1 </p>\r\n<p>Dobrucki 1 </p>\r\n<p><u>Garbarnia : UKS Świt II 10:1 </u></p>\r\n<p>Bryndza 6 | Ciombor 1 </p>\r\n<p><u>Prokocim : Skawinka 3:1 </u></p>\r\n<p>Kowalik 1 | Sekula 1 </p>\r\n<p>Brzoskwinia 1 </p>\r\n<p>Wlodarczyk 1 </p>\r\n<p><u>UKS Świt I : Grajpek 3:1 </u></p>\r\n<p>Marszalek 2 | Mietniowski 1 </p>\r\n<p>Nowotarski 1 </p>\r\n<p><u>UKS Świt II : Skawinka 0:0 </u></p>\r\n<p><u>Garbarnia : Prokocim 5:2 </u></p>\r\n<p>Bryndza 2 | Brzoskwinia 2 </p>\r\n<p>Cebula 3 </p>\r\n<p><u>Garbarnia : UKS Świt I 3:1 </u></p>\r\n<p>Dobrucki 1 | Marszalek 1 </p>\r\n<p>Janka K 1 </p>\r\n<p>Irzyk 1 </p>\r\n<p><u>Prokocim : UKS Świt II 7:1</u></p>\r\n<p>Dolczak 2 | Kuflik 1 </p>\r\n<p>Brzoskwinia 3 </p>\r\n<p>Kafel 1 </p>\r\n<p>Kowalik 1 </p>\r\n<p><u>Skawinka : UKS Świt I 6:2 </u></p>\r\n<p>Sekula 1 | Marszalek 2 </p>\r\n<p>Melz 2 </p>\r\n<p>Lukasik 1 </p>\r\n<p>Czara 1 </p>\r\n<p>Gornisiewicz 1 </p>\r\n<p><u>Prokocim : Grajpek 3:0 </u></p>\r\n<p>Brzoskwinia 3 </p>\r\n<p>Najciekawszym meczem turnieju byl mecz o 1 miejsce\r\npomiedzy\r\ndruzynami Garbarni Krakow i UKS Świt I. Prowadzenie dla druzyny\r\ngospodarzy uzyskal Marszalek Mateusz. Wynik ten utrzymywal sie do\r\nprzerwy. W 5 minucie drugiej polowy wybijali rzut rozny po ktorym\r\nbardzo dobrze spisujacy sie bramkarz gospodarzy Curylo Pawel zamiast\r\nzlapac pilke wybil ja pod nogi nadbiegajacego Marcina Dobruckiego,\r\nktory doprowadzil do wyrownania. Gospodarze po utracie bramki\r\nzaatakowali z impetem stwarzajac liczne sytuacje podbramkowe. W jednej\r\nz nich bramkarz Garbarni w pieknym stylu obronil strzal Piotra Saroty\r\n(w sytuacji sam na sam) po wzorowo wyprowadzonej kontrze druzyny\r\ngospodarzy. Piec minut przed koncem kolejny blad popelnil bramkarz\r\ndruzyny UKS Świt I podajac pilke prosto pod noge napastnikowi Garbarni,\r\nktory uzyskal prowadzenie dla gosci. Ostatnie minuty mecyz to szturm\r\ngospodarzy ktory na nasze nieszczescie nie przyniosl nam upragnionego\r\ngola lecz po przejeciu pilki przez gosci i bezblednie wyprowadzonej\r\nkontrze stracilismy gola. Mecz zakonczyl sie wynikiem 3:1 dla Garbarni.\r\nOstatni mecz ze Skawinka gralismy o pietruszke poniewaz mielismy II\r\nmiejsce w turnieju. Nasi zawodnicy potraktowali ulgowo przegrywajac z\r\ndruzyna Skawinki </p>\r\n<p>Tabela koncowa turnieju : </p>\r\n<p>1.Garbarnia Krakow </p>\r\n<p>2.UKS Świt I Krzeszowice </p>\r\n<p>3.Prokocim Krakow </p>\r\n<p>4.Skawinka Skawina </p>\r\n<p>5.UKS Świt II Krzeszowice </p>\r\n<p>6.Grajpek Grajow </p>\r\n<p>Najlepszym zawodnikiem turnieju uznany zostal Mateusz\r\nCebula ,\r\nkrolem strzelcow zostal Marcin Bryndza (obaj Garbarnia Krakow), a\r\nnajlepszym bramkarzem Paweł Curyło (UKS Świt I Krzeszowice)\r\n</p>', NULL, NULL),
	(6, 'Turniej gimnazjalny 2006', 'turniej-gimnazjalny-2006', ' Dnia 18.03.06r. na hali w Krzeszowicach odbyl sie turniej dla mlodziezy gimnazjalnej. Oto jego wyniki\r\n\r\nReal Madryt : Wisla Krakow 4:1\r\n\r\nZimolag 3 | Szlosarczyk 1\r\n\r\nKleczek 1\r\n\r\nFC Barcelona : AC Milan 2:0\r\n\r\nKlosowski 2\r\n\r\nReal Madryt : Barcelona 5:0\r\n\r\nKrzysiak 3\r\n\r\nKleczek 2\r\n\r\nAC Milan : Wisla Krakow 2:1\r\n\r\nAtlas 1 | Szlosarczyk 1\r\n\r\nWilk 1\r\n\r\nReal Madryt : AC Milan 2:1\r\n\r\nKleczek 1 | Kozub 1\r\n\r\nKrzysiak 1\r\n\r\nFC Barcelona : Wisla Krakow 2:1\r\n\r\nWyniki koncowe :\r\n\r\n1.Real Madryt\r\n\r\n2.FC Barcelona\r\n\r\n3.AC Milan\r\n\r\n4.Wisla Krakow\r\n', NULL, NULL),
	(7, 'Turniej oldbojow o Puchar Burmistrza 2007 ', 'turniej-oldbojow-o-puchar-burmistrza-2007', '<p>4.03.07r. na hali w Krzeszowicach odbył się turniej\r\noldbojów o puchar Burmistrza Krzeszowic </p>\r\n<p>Wzięły w nim udział drużyny Eden Springs Poland, Pyszne\r\nKrzeszowice, Wadów i Wielkie Piece </p>\r\n<p>Oto wyniki</p>\r\n<p>Eden : Wadów 4:5 </p>\r\n<p>Czerwiec 1,Mateńko 1,Przeniosło 1,Socha 1 - Maj 2,\r\nSprynca 1,Wydra 1 </p>\r\n<p>Pyszne : Wielkie Piece 5:5 </p>\r\n<p>Fryda 2,Nowak1, Gaweł 1, Szymanski 1 - Wojdyła\r\n3,Kwiecień 1, Wajler 1 </p>\r\n<p>Wielkie Piece : Eden 2:2 </p>\r\n<p>Kwiecień 1,Wojdyła 1 - Mateńsko 1,Działowy 1 </p>\r\n<p>Wadów : Pyszne 5:2 </p>\r\n<p>Sprynca 2, Maj 3 - Zimolag 1, Fryda 1 </p>\r\n<p>Wadów : Wielkie Piece 4:3 </p>\r\n<p>Maj 2, Wydra 2 - Juszczyk 1, Kuras 1 </p>\r\n<p>Pyszne : Eden 2:4 </p>\r\n<p>Zimoląg 1, Kmieć 1 - Socha 1, Mateńko 1,Działowy\r\n1,Dankiewicz 1 </p>\r\n<p>Koncowa kolejnosc : </p>\r\n<p>1.Wadów </p>\r\n<p>2.Eden Springs Poland </p>\r\n<p>3.Wielkie Piece </p>\r\n<p>4.Pyszne Krzeszowice </p>\r\n', NULL, NULL),
	(8, 'Turniej w Kazimierzy Wielkiej 2007', 'turniej-w-kazimierzy-wielkiej-2007', '<p>25.01.07r. odbyl sie turniej juniorow mlodszych w\r\nKazimierzy Wielkiej </p>\r\n<p>Wziela w nim udzial nasza druzyna </p>\r\n<p>Oto wyniki : </p>\r\n<p>Grupa II </p>\r\n<p>UKS / Swit : Mlek-Pol Kazimierza Wielka 1:0 </p>\r\n<p>UKS / Swit : Krakus Nowa Huta 1:1 </p>\r\n<p>UKS / Swit : Sparta Kazimierza Wielka 0:0 </p>\r\n<p>1.Krakus </p>\r\n<p>2.UKS / Swit </p>\r\n<p>3.Sparta </p>\r\n<p>4.Mlek-pol </p>\r\n<p> Polfinal : </p>\r\n<p>UKS / Swit : Garbarnia Krakow 0:1 </p>\r\n<p>Mecz o 3 miejsce </p>\r\n<p>UKS / Swit : Wieczysta 1:1 (k. 2:1) </p>\r\n<p> Koncowa kolejnosc : </p>\r\n<p>1.Krakus Nowa Huta </p>\r\n<p>2.Garbarnia Krakow </p>\r\n<p>3. UKS / Swit Krzeszowice </p>\r\n<p>4. Wieczysta Krakow </p>\r\n<p>5.Sparta Kazimierza Wielka </p>\r\n<p>6.Kmita Zabierzow </p>\r\n<p>7.Orly Bodzentyn </p>\r\n<p>8.Mlek-Pol Kazimierza Wielka </p>\r\n<p>Najlepszym bramkarzem turnieju zostal wybrany nasz\r\nzawodnik Pawel Curylo </p>\r\n<img src="dziama.jpg" align="middle" height="200" width="150">\r\n<p>Wystapilismy w skladzie : </p>\r\n<p>Curylo Pawel, Felus Pawel, Mucha Artur, Funek Adrian,\r\nMarszalek\r\nMateusz, Sarota Piotr, Biga Mateusz, Ciombor Mateusz, Nowotarski\r\nBartosz, Kardas Tomasz, Kuflik Sebastian, Kowalczyk Krystian </p>\r\n<img src="uks.jpg" align="middle" height="200" width="150"><br>', NULL, NULL),
	(9, 'Turniej inauguracyjny Liga Mistrzów 2008', 'turniej-inauguracyjny-liga-mistrzow-2008', '<br>\r\nW dniu 8 XI 2008r. UKS "Jedynka"\r\nzorganizował turniej halowej piłki nożnej chłopców rozpoczynający\r\nrozgrywki w ramach młodzieżowej "Ligi Mistrzów". Na turnieju był obecny\r\nBurmistrz Gminy Krzeszowice p. Czesław Bartl, który dokonał otwarcia\r\nmłodzieżowej ligi. <br>\r\nA oto wyniki meczów czwórki finałowej turnieju :<br>\r\n<br>\r\nKS Bukmacherzy : Wisła Kraków 0:3<br>\r\nDla Wisły - Marszałek J 2, Kłosowski B 1<br>\r\n<br>\r\nZespół R : WKSTS 2:1<br>\r\nKrasucki 1, Simmler 1 - Derejko 1<br>\r\n<br>\r\nWisła Kraków : Zespół R 6:0<br>\r\nMarszałek J 3, Kłosowski B 3<br>\r\n<br>\r\nKS Bukmacherzy : WKS TS 3:2<br>\r\nFeluś D 2, Wójcik M 1 - Hrabia 1, Derejko 1<br>\r\n<br>\r\nWisła Kraków : WKS TS 8:0<br>\r\nKłosowski B 4, Marszałek J 3, Toczek 1<br>\r\n<br>\r\nKS Bukmacherzy : Zespół R 2:0<br>\r\nWójcik M 1, Banach P 1<br>\r\n<br>\r\n<table style="margin:0 30%;">\r\n    <tr>\r\n        <th colspan="2">Tabela końcowa</th>\r\n    </tr>\r\n    <tr>\r\n        <td>1</td>\r\n        <td>Wisła Kraków</td>\r\n        <td>3</td>\r\n        <td>9</td>\r\n        <td>17:0</td>\r\n    </tr>\r\n    <tr>\r\n        <td>2</td>\r\n        <td>KS Bukmacherzy</td>\r\n        <td>3</td>\r\n        <td>6</td>\r\n        <td>5:5</td>\r\n    </tr>\r\n    <tr>\r\n        <td>3</td>         \r\n        <td>Zespół R</td>\r\n        <td>3</td>\r\n        <td>3</td>\r\n        <td>2:9</td>\r\n    </tr>\r\n    <tr>\r\n        <td>4</td>\r\n        <td>WKS TS</td>\r\n        <td>3</td>\r\n        <td>0</td>\r\n        <td>3:13</td>\r\n    </tr>\r\n</table>\r\n', NULL, NULL),
	(10, 'Turniej oldbojów 2008', 'turniej-oldbojow-2008', '<br>\r\nWyniki turnieju oldbojów rozegranego w Październiku 2008r.<br>\r\n<br>\r\nGrupa A<br>\r\nPyszne : Samorządowcy Krzeszowice 10:0<br>\r\nGawęcki P 2, Kmieć 2, Kardas W 2, Fryda 2, Zimoląg 1, Nowak 1<br>\r\n<br>\r\nWadów : Nordea 3:1<br>\r\nGruchała 2, Kalisz 1 - Wajler 1<br>\r\n<br>\r\nPyszne : Wadów 5:0<br>\r\nGawęcki P 1, Kmieć 2, Zimoląg 1, Fryda 1 <br>\r\n<br>\r\nNordea : Samorządowcy Krzeszowice 5:3<br>\r\nWajler 2, Pituła 2, Kopalski 1 - Baranowski 1, Pałka W 1, Godyń A 1<br>\r\n<br>\r\nPyszne : Nordea 6:2<br>\r\nKmieć 3, Kardas 1, Nowak 1, Gawęcki 1 - Pituła 1, Juszczyk 1<br>\r\n<br>\r\nSamorządowcy Krzeszowice : Wadów 3:1<br>\r\nBaranowski 2, Godyń 1<br>\r\n<br>\r\n<table style="margin:0 25%;"> <tr> <th colspan="2">Tabela grupa A</th></tr>\r\n<tr>\r\n    <td>1</td>\r\n    <td>Pyszne </td>\r\n    <td>3</td>\r\n    <td>9</td>\r\n    <td> 21:2</td>\r\n</tr>\r\n<tr>\r\n    <td>2</td>\r\n    <td>Nordea</td>\r\n    <td>3</td>\r\n    <td>3</td>\r\n    <td>8:12</td>\r\n</tr>\r\n<tr>\r\n    <td>3</td>\r\n    <td>Wadów</td>\r\n    <td>3</td>\r\n    <td>3</td>\r\n    <td>4:9</td>\r\n</tr>\r\n<tr>\r\n    <td>4</td>\r\n    <td>Samorządowcy Krzeszowice</td>\r\n    <td>3</td>\r\n    <td>3</td>\r\n    <td>6:16</td>\r\n</tr>\r\n</table>\r\n<br>\r\n<br>\r\nGrupa B <br>\r\n<br>\r\nValeo : KW Czatkowice 3:1<br>\r\nKurański 1, Ludwig 1, Czerny 1 - Gawroński 1<br>\r\n<br>\r\nRegulice : Trzemieśnia 3:0<br>\r\nKramarczyk Zb 1, Dudek 1, Rożnowski 1<br>\r\n<br>\r\nTrzemieśnia : Valeo 3:0<br>\r\nGórka W 1, Górka B 1, Bargiel 1<br>\r\n<br>\r\nRegulice : KW Czatkowice 3:0<br>\r\nDudek 1, Kramarczyk Zb. 1, Biel 1<br>\r\n<br>\r\nRegulice : Valeo 3:2<br>\r\nKramarczyk Zb 1, Kramarczyk J 1, Dudek 1 - Kurański 2<br>\r\n<br>\r\nKW Czatkowice : Trzemieśnia 3:4<br>\r\nŁątka 1, Bień 2 - Górka W 2, Górka B 2<br>\r\n<br>\r\n<table style="margin:0 32%;"> <tr> <th colspan="2">Tabela grupa B</th></tr>\r\n    <tr>\r\n        <td>1</td>\r\n        <td>Regulice</td>\r\n        <td>3</td>\r\n        <td>9</td>\r\n        <td>9:2</td>\r\n    </tr>\r\n     <tr>\r\n        <td>2</td>\r\n        <td>Trzemieśnia</td>\r\n        <td>3</td>\r\n        <td>6</td>\r\n        <td>7:6</td>\r\n    </tr>\r\n   <tr>\r\n        <td>3</td>\r\n        <td>Valeo</td>\r\n        <td>3</td>\r\n        <td>3</td>\r\n        <td>5:7</td>\r\n    </tr>\r\n   <tr>\r\n        <td>4</td>\r\n        <td>KW Czatkowice</td>\r\n        <td>3</td>\r\n        <td>0</td>\r\n        <td>4:10</td>\r\n    </tr>\r\n</table>\r\n<br>\r\nPółfinały <br>\r\nRegulice : Nordea 3:1<br>\r\nDudek M 1, Kramarczyk Zb 1, Kramarczyk J 1 - Waljer 1<br>\r\n<br>\r\nTrzemieśnia : Pyszne 2:9<br>\r\nDąbrowski 2 - Zimoląg 3, Kmieć3, Kościółek 1, Gaweł 1, Fryda 1<br>\r\n<br>\r\nFinał<br>\r\nPyszne : Regulice 2:0<br>\r\nFryda 1, Zimoląg 1<br>', NULL, NULL),
	(11, 'Turniej o puchar Przewodniczącej Rady Miejskiej', 'turniej-o-puchar-przewodniczacej-rady-miejskiej', '<p>Wyniki Zimowego Turnieju o Puchar Przewodniczacej Rady\r\nMiasta organizowanego przez UKS "Jedynka" Krzeszowice </p>\r\n<p> Trampkarze Mlodsi : </p>\r\n<p> UKS : Gorzanka 1:1 </p>\r\n<p> Wolanka : Tecza 0 : 6 </p>\r\n<p> UKS : Wolanka 9:0</p>\r\n<p> Tecza : Gorzanka 0:1 </p>\r\n<p> Tecza : UKS 3:1 </p>\r\n<p> Wolanka : Gorzanka 3 : 1 </p>\r\n<p> Turniej w kategorii Trampkarze Mlodsi wygrala Gorzanka.\r\nKrolem strzelcow zostal Labuzek z Teczy</p>\r\n<p>Trampkarze Starsi </p>\r\n<p>Tecza : Sankovia 1:5 </p>\r\n<p>UKS : Sankovia 9:2 </p>\r\n<p>UKS : Tecza 12:2 </p>\r\n<p> Turniej w kategorii Trampkarze Starsi wygral UKS.\r\nKrolami strzelcow zostali Mucha i Sarota obaj z UKS-u</p>\r\n<p>Juniorzy Mlodsi </p>\r\n<p>UKS : Tenczynek 5:4 </p>\r\n<p> Turniej w kategorii Juniorzy Mlodsi wygral UKS. Krolem\r\nstrzelcow zostal Czak z Teczy</p>\r\n<p>Juniorzy Starsi </p>\r\n<p>Wolanka : UKS 4:1 </p>\r\n<p> Turniej w kategorii Juniorzy Starsi wygrala Wolanka.\r\nKrolem strzelcow zostal Stafiej z Wolanki</p>', NULL, NULL),
	(12, 'Dzień dziecka 2008', 'dzien-dziecka-2008', 'Uczniowski Klub Sportowy "Jedynka" przy Gimnazjum w Krzeszowicach\r\nzorganizował blok imprez imprez rekreacyjno-sportowych z okazji Dnia\r\nDziecka.<br>\r\nWszystkie imprezy były zorganizowane we współpracy\r\nMiędzyszkolnego Ośrodka Sportowego w Krzeszowicach w ramach jubileuszu\r\n30 lecia MOS-u.<br>\r\n<br>\r\nW dniu 26 V 2008.r przeprowadzony został turniej halowej piłki nożnej\r\ndziewcząt z rocznika 1992 i młodszych. Patronat nad turniejem objęła Przewodnicząca\r\nRady Miejskiej w Krzeszowicach pani Marta Sobczyk , która ufundowała\r\npamiątkowe medale dla wszystkich uczestniczek zawodów. Do turnieju\r\nprzystąpiły reprezentantki 4 gimnazjów z naszej gminy tj. Gimnazjum\r\nZalas, Gimnazjum Nowa Góra, Gimnazjum Tenczynek oraz gospodynie\r\nturnieju Gimnazjum Krzeszowice.<br>\r\nA oto wyniki turnieju:<br>\r\n1.Nowa Góra : Tenczynek 3:0<br>\r\nSikora R.1<br>\r\nPałka K.1<br>\r\nKłeczek K.1<br>\r\n 2.Krzeszowice : Zalas 0:7 Gorczyca E 3,Gorczyca\r\nM 2,Czech K 1,Korzun1.<br>\r\n 3.Krzeszowice: Nowa Góra 0:5 Sikora R 2,Pałka K 2,Chudziak J 1.<br>\r\n 4.Zalas : Tenczynek 6:0<br>\r\nGorczyca E 4<br>\r\nKorzun E 1<br>\r\nSzklarska J 1<br>\r\n 5.Nowa : Góra Zalas 0: 2 Gorczyca E 2<br>\r\n 6.Krzeszowice : Tenczynek 1 : 1<br>\r\nCisak K 1<br>\r\nDomagalska M 1<br>\r\n<br>\r\nKolejność miejsc w turnieju : 1.Gimnazjum Zalas<br>2.Gimnazjum\r\nNowa Góra<br>\r\n3.Gimnazjum Tenczynek<br>4.Gimnazjum Krzeszowice.<br>\r\nNajlepszym bramkarzem turnieju została Małgorzata Biga z Tenczynka<br>\r\nNajlepszym strzelcem turnieju została Edyta Gorczyca z Zalasu<br>\r\nNajlepszym zawodnikiem turnieju została Katarzyna Czech z Zalasu.<br>\r\nW turnieju wystąpiło 40 zawodniczek.<br>\r\n<br>\r\n W dniu 29 V 2008r został przeprowadzony turniej halowej piłki\r\nnożnej chłopców z rocznika 1994 <br>\r\ni młodszych. Patronat nad turniejem objał Burmistrz Krzeszowic pan\r\nCzesław Bartl.<br>\r\nDo udziału w turnieju zgłosiły się następujące drużyny:UKS Trzebinia,\r\nOlimpijczyk Chrzanów,Prokocim Kraków,Kmita Zabierzów,UKS I\r\nKrzeszowice,UKS II Krzeszowice.<br>\r\nA oto wyniki turnieju:<br>\r\n1.Olimpijczyk Chrzanów : UKS II Krzeszowice 4 : 0<br>\r\nGaudyn 2,Górczyk1<br>\r\nPazgan1<br>\r\n2.Prokocim : Kmita Zabierzów 0 : 1<br>\r\nKadula P.1<br>\r\n3.UKS Krzeszowice : UKS Trzebinia 1 : 3<br>\r\nNawała B. 1 Kuciel M.1, Pająk J.1,Dudek A.1<br>\r\n4.UKS II Krzeszowice : Kmita Zabierzów 0 : 7<br>\r\nZając T.3, Żurek 2, Kadula P.1,Matacz 1<br>\r\n5. Olimpijczyk Chrzanów : UKS\r\nTrzebinia 1 : 5<br>\r\nGórczyk 1 Dudek A.2, Kuciel M.2,Leśniak 1<br>\r\n6.Prokocim Kraków : UKS I Krzeszowice 2: 0<br>\r\nFurtak J.2<br>\r\n7.Olimpijczyk Chrzanów : Kmita Zabierzów 5 :0<br>\r\nKlocek 2, Górczyk 1,Bębenek 1 Mierzwa 1<br>\r\n8.UKS Trzebinia : Prokocim Kraków 3 : 0<br>\r\nPająk J.2,Pudełek 1<br>\r\n9.UKS I Krzeszowice : UKS II Krzeszowice 3 : 1<br>\r\nKłosowski B.2 Kij P.1 Nawała B.1<br>\r\n10.Olimpijczyk Chrzanów : UKS I Krzeszowice 2 : 1<br>\r\n Bębenek 1, Mierzwa 1 Nawała B.1 <br>\r\n11.Prokocim Kraków : UKS II Krzeszowice 2 : 1<br>\r\nŁojszczyk 1, Nosal 1 Kłosowski B.1<br>\r\n12.UKS Trzebinia : Kmita Zabierzów 3: 1<br>\r\nPająk J.2, Kuciel 1 Gudowski D.1<br>\r\n13.Prokocim Kraków : Olimpijczyk Chrzanów2 : 3 <br>\r\nTupta 1, Furtak 1 Bieda 2, Gaudyn 1<br>\r\n14. UKS I Krzeszowice : Kmita Zabierzów 4 : 0<br>\r\n Nawała B.2,Toczek 1.Kozioł 1<br>\r\n15. UKS II Krzeszowice : UKS Trzebinia 0 : 5<br>\r\nPająk J.1,Dudek 1,Głuch 1.Okarmus 1,Kurzymski 1.<br>\r\n <br>\r\n Kolejność miejsc w turnieju przedstawia się następująco:<br>\r\n 1.UKS Trzebinia ,<br>2.Olimpijczyk<br>\r\nChrzanów,<br>3.UKS I Krzeszowice <br>4.Prokocim Kraków,<br>\r\n 5.Kmita Zabierzów <br>6.UKS II Krzeszowice.<br>\r\n Najlepszym zawodnikiem turnieju został\r\nJakub Pająk z Trzebini<br>\r\n Najlepszym bramkarzem turnieju został\r\nGudowski Dawid z Chrzanowa <br>\r\n Najlepszym strzelcem turnieju został\r\nDudek Andrzej z Trzebini.<br>\r\n <br>\r\n W turnieju wzięło udział 65 zawodników.<br>\r\n <br>\r\nW dniu 30 V 2008 przeprowadzony został turniej piłki siatkowej dziewcząt\r\ni chłopców z rocznika 1993 i młodszych .Patronat nad turniejem objął\r\nPrzewodniczący Komisji Promocji Gminy , Kultury,Sportu,Turystyki i\r\nRekreacji pan Jerzy Wieczorek.<br>\r\n Do turnieju zgłosiły się następujące drużyny: dziewczęta UKS Dobry Wynik\r\nKraków,Oświęcim, Bielsko Biała ,Rybna , MKS MOS MaratonKrzeszowice.\r\n<br>\r\nChłopcy: UKS Dobry Wynik Kraków I, UKS Dobry Wynik Kraków II,MKS\r\nAndrychów,Kęczanin Kęty,MKS MOS Maraton Krzeszowice.<br>\r\n<br>\r\nA oto wyniki turnieju :<br>\r\ndziewczęta\r\nchłopcy<br>\r\n1.Kraków : Rybna 2 :0\r\n1.Kraków II : Andrychów 0 : 2<br>\r\n2.Rybna : Oświęcim 2 :0\r\n2.Andrychów : Kęty 2 : 0<br>\r\n3.Krzeszowice : Kraków 1 :1\r\n3.Kraków I : Kraków II 2 : 0<br>\r\n4.Oświęcim :Krzeszowice 0 : 2\r\n4.Kraków I : Kęty2 : 0<br>\r\n5.Krzeszowice : Bielsko 0 : 2\r\n5.Krzeszowice : Kraków I 0 : 2<br>\r\n6.Bielsko : Kraków 1 :1\r\n6.Kęty : Kraków II 2 : 0<br>\r\n7.Krzeszowice: Rybna 2 :0\r\n7.Kraków II : Krzeszowice 0 : 2<br>\r\n8.Oświęcim : Bielsko 0 :2\r\n8.Krzeszowice : Andrychów 0 : 2<br>\r\n9.Bielsko : Rybna 2 :0\r\n9.Kęty : Krzeszowice 1 : 1<br>\r\n10.Kraków : Oświęcim 2 :0\r\n10.Andrychów : Kraków I 2 : 0<br>\r\n <br>\r\nKolejność miejsc przedstawia się następująco:<br>\r\ndziewczęta\r\nchłopcy<br>\r\n1.Bielsko\r\nBiała\r\n1.MKS Andrychów<br>\r\n2.UKS Dobry Wynik\r\nKraków\r\n2.UKS Dobry Wynik Kraków I<br>\r\n3.MKS MOS Maraton\r\nKrzeszowice\r\n3.Kęczanin Kęty <br>\r\n4.Rybna\r\n4.MKS MOS Maraton Krzeszowice<br>\r\n5.Oświęcim\r\n5.UKS Dobry Wynik Kraków II<br>\r\nW Turnieju wzięło udział 120 osób.<br>\r\nW dniu 1VI odbył się konkurs rzutów karnych strzelanych Arturowi\r\nSarnatowi byłemu bramkarzowi Wisły Kraków. W konkursie\r\nuczestniczyło 30 osób. Królem strzelców został Grzegorz Krzysiak .<br>\r\nW niedzielę również dzieci korzystały bezpłatnie z takich atrakcji jak\r\nzjeżdżalnia , zamek dmuchany,banghi.<br>\r\nCały blok imprez rekreacyjno- sportowych został zorganizowany w ramach\r\nZadania Publicznego Gminy pt."Upowszechnianie Współzawodnictwa i\r\nSzkolenia Sportowego w Gminie Krzeszowice. Uczniowski Klub Sportowy\r\n"Jedynka" składa serdeczne podziękowanie firmom ,które dofinansowały\r\norganizację Dnia Dziecka pt."Krzeszowice Dzieciom". Są to :pan\r\nKrzysztof Kramarczyk, Ambasador, Bostar , Chemmark, Elwast\r\nInstalterm, KOKO, Melba, Oknostyl, Olmar, Oriflame. <br>', NULL, NULL),
	(13, 'Turniej juniorów młodszych 2008', 'turniej-juniorow-mlodszych-2008', '<p>Uczniowski Klub Sportowy "Jedynka" przy Gimnazjum w\r\nKrzeszowicach\r\nzorganizowal Mikołajkowy Turniej Halowej Piłki Nożnej Juniorów\r\nMłodszych o puchar Burmistrza Gminy Krzeszowice.</p>\r\n<p> W turnieju wziely udzial druzyny : Prokocim Krakow,\r\nGrajpek Grajow,\r\nWisla Krakow , SMS Krakow, Krakus Nowa Huta, UKS I Krzeszowice, UKS II\r\nKrzeszowice </p>\r\n<p> Wyniki turnieju : </p>\r\n<p> Grupa A : </p>\r\n<p> SMS Krakow : Wisla 1:2 </p>\r\n<p> Stanislawczyk A 1 - Litewka D 1, Popowicz A 1 </p>\r\n<p> UKS I : Grajpek 0:0 </p>\r\n<p> SMS Krakow : UKS I 1:3 </p>\r\n<p> Kaszkowski A 1 - Sarota 2, Ciombor 1 </p>\r\n<p> Wisla : Grajpek 4:1 </p>\r\n<p> Chrapek 1, Kaczor 1, Marzec 2 - Malicki 1 </p>\r\n<p> UKS I : Wisla 0:2 </p>\r\n<p> Litewka 1, Skorski 1 </p>\r\n<p> SMS : Grajpek 2:0 </p>\r\n<p> Bukalski D 1, Swierczok J 1 </p>\r\n<p> Tabela grupa A </p>\r\n<p> 1.Wisla Krakow</p>\r\n<p> 2.UKS I </p>\r\n<p> 3.SMS Krakow </p>\r\n<p> 4.Grajpek Grajow </p>\r\n<p> Grupa B: </p>\r\n<p> Krakus : Prokocim 1:0 </p>\r\n<p> Wilga 1 </p>\r\n<p> Krakus : UKS II 7:0 </p>\r\n<p> Jagla 1, Gruszecki 2, Kuligowski 1, Labecki 2,\r\nZugajewicz 1 </p>\r\n<p> UKS II : Prokocim 2:5 </p>\r\n<p> Brzowskwinia 1, Wojcik 1, Mleczek 1, Cyburt 1, Pudlik 1\r\n</p>\r\n<p> Tabela grupa B </p>\r\n<p> 1.Krakus </p>\r\n<p> 2.Prokocim </p>\r\n<p> 3.UKS II </p>\r\n<p> Mecze o miejsca 5-7 </p>\r\n<p> UKS II : Grajpek 2:4 </p>\r\n<p> Gregorczyk 1, Janikowski 1 - Lesniak 2, Jaros 2 </p>\r\n<p> UKS II : SMS 1:6 </p>\r\n<p> Gregorczyk 1 - Bukalski 2, Nguyen 2 , Gubala 1,\r\nSwierczok 1 </p>\r\n<p> Polfinaly : </p>\r\n<p> Wisla : Prokocim 1:4 </p>\r\n<p> Curapek 1 - Mleczek 3, Dolczak 1 </p>\r\n<p> Krakus : UKS I 2:2 k.2:3 </p>\r\n<p> Trzos 1, Jagla 1 - Sarota 2 </p>\r\n<p> Mecz o 3 miejsce </p>\r\n<p> Wisla : Krakus 1:2 </p>\r\n<p> Kaczor 1 - Tabor 1, Labecki 1 </p>\r\n<p> Final </p>\r\n<p> Prokocim : UKS I 3:1 </p>\r\n<p> Palczak 1, Cyburt 1, Mleczek 1 - Sarota 1 </p>\r\n<p> Kolejnosc koncowa : </p>\r\n<p> 1.Prokocim Krakow </p>\r\n<p> 2.UKS I Krzeszowice </p>\r\n<p> 3.Krakus Nowa Huta </p>\r\n<p> 4.Wisla Krakow </p>\r\n<p> 5.SMS KRakow </p>\r\n<p> 6.Grajpek Grajow </p>\r\n<p> 7.UKS II Krzeszowice </p>\r\n<p> Najlepszy strzelec turnieju : Meczek Lukasz (Prokocim) </p>\r\n<p> Najlepszy zawodnik turnieju : Sarota Piotr (UKS I) </p>\r\n<p> Najlepszy bramkarz turnieju : Jekot Adrian (Krakus) </p>\r\n<br>', NULL, NULL),
	(14, 'Puchar burmistrza Krzeszowic 2009', 'puchar-burmistrza-krzeszowic-2009', 'W rozegranym w dniach 7-8 luty Turnieju Halowej Piłki Nożnej o Puchar\r\nBurmistrza Krzeszowic zwyciężyła drużyna ETA "Szóstka" Dąbrowa Górnicza\r\nprzed Adi I Wola Filipowska oraz UKS "Jedynka" Krzeszowice. Najlepszym\r\nstrzelcem turnieju został Piotr Sobczak z 7 bramkami,najlepszym\r\nzawodnikiem wybrano Artura Popławskiego (obaj ETA "Szóstka" Dąbrowa\r\nGórnicza) natomiast za najlepszego bramkarza turnieju uznano Piotra\r\nFilipka z drużyny Adi I Wola Filipowska.<br>\r\n<br>\r\nWyniki fazy finałowej:<br>\r\nUKS Jedynka Krzeszowice : Eta "Szóstka" Dąbrowa Górnicza 3:2<br>\r\nKupczyk Kraków : Adi II Wola Filipowska1:5<br>\r\nOldboje Krzeszowice : Adi I Wola Filipowska 2:3<br>\r\nKupczyk Kraków : ETA "Szóstka" Dąbrowa Górnicza 0:1<br>\r\nAdi I Wola Filipowska : Adi II Wola Filipowska 5:3<br>\r\nOldboje Krzeszowice : UKS Jedynka Krzeszowice 2:3<br>\r\nKupczyk : Adi I 1:2<br>\r\nETA "Szóstka" : Oldboje 11:2<br>\r\nAdi II : UKS I 2:4<br>\r\nETA "Szóstka" : Adi I 2:1<br>\r\nKupczyk : UKS I 3:0<br>\r\nOldboje : Adi II 4:6<br>\r\nAdi I : UKS Jedynka 2:0<br>\r\nKupczyk : Oldboje 6:1<br>\r\nAdi II : ETA "Szóstka" 2:5<br>\r\n<br>\r\nKlasyfikacja końcowa grupy finałowej :<br>\r\n1.ETA "Szóstka" Dąbrowa Górnicza<br>\r\n2.Adi I Wola Filipowska<br>\r\n3.UKS Jedynka Krzeszowice<br>\r\n4.Adi II Wola Filipowska<br>\r\n5.Kupczyk Kraków<br>\r\n6.Oldboje Krzeszowice<br>\r\n<br>\r\nPatronem medialnym turnieju był portal Futbol-Małopolska (futbol.org.pl)<br>\r\n<br>', NULL, NULL),
