	(21, 'Turniej oldbojow 2010', 'turniej-oldbojow-2010', 'W ostatnią sobotę 20.03.2010 na naszej hali rozegrany został turniej halowej piłki nożnej\r\noldbojów. Zwyciężyli oldboje z Krzeszowic, przed Manhattanem Trzebinia\r\ni drużyną Zibi & Koledzy. Królem strzelców z 5 bramkami został\r\nRobert Gaweł(Krzeszowice), najlepszym zawodnikiem wybrano Zbigniewa Kramarczyka (Zibi & Koledzy) a tytuł najlepszego bramkarza przypadł Włodzimierzowi Skoczylasowi (Manhattan Trzebinia)<br><br>\r\nWyniki : <br>Krzeszowice : Zibi & Koledzy 10:2<br>Hattrick Łączany : Manhattan Trzebinia 1:2<br>Krzeszowice : Hattrick Łączany 7:2<br>Zibi & Koledzy : Manhttan 1:4<br>Krzeszowice : Manhattan 5:1<br>Hattrick Łączany : Zibi & Koledzy 2:3<br><br>Końcowa kolejność<br>1.Krzeszowice<br>2.Manhattan Trzebinia<br>3.Zibi & Koledzy<br>4.Hattrick Łączany<br><br>Najlepszy strzelec : Robert Gaweł(Krzeszowice)<br>Najlepszy zawodnik : Zbigniew Kramarczyk (Zibi & Koledzy<br>Najlepszy bramkarz : Włodzimierz Skoczylas (Manhattan Trzebinia)<br>', NULL, NULL),
	(22, 'Dzień dziecka 2010', 'dzien-dziecka-2010', 'Uczniowski Klub Sportowy\r\n"Jedynka" przy Gimnazjum w Krzeszowicach zorganizował pod patronatem Burmistrza Gminy Krzeszowicewe współpracy z Publicznym\r\nGimnazjum w Krzeszowicach oraz Komendą Hufca ZHP blok imprez rekreacyjno-sportowych\r\nz okazji Dnia Dziecka<br>\r\nCzęść sportowa obejmowała\r\norganizację turniejów : <br>\r\n- halowej piłki nożnej dziewcząt i chłopców<br>\r\n- piłki siatkowej dziewcząt <br>\r\n- piłki koszykowej w ramach klubów młodzieżowych prowadzonych dzięki pełnomocnikowi Burmistrza d/s Profilaktyki i Uzależnień p.Ninie Kurdziel<br>\r\nW turnieju piłki nożnej dziewcząt wystąpiło 5 drużyn :\r\nGimnazjum Zalas, SP Krzeszowice oraz 3 drużyny z Gimnazjum Krzeszowice <br>\r\nA oto wyniki :  <br>\r\nSP Krzeszowice : Gim. Zalas 0:0<br>\r\nGim. Krzeszowice I : Gim.Krzeszowice II 3:2<br>\r\nSP Krzeszowice : Gim.Krzeszowice III 1:0<br>\r\nGim. Krzeszowice I : SP Krzeszowice 0:1<br>\r\nGim. Zalas : Gim. Krzeszowice III 2:0<br>\r\nGim. Krzeszowice II : Gim.Krzeszowice I 0:1<br>\r\nGim. Krzeszowice II : SP Krzeszowice 1:1<br>\r\nGim. Krzeszowice I : Gim. Zalas 0:2<br>\r\nGim. Krzeszowice II : Gim.Zalas 0:1<br>\r\nGim. Krzeszowice II : Gim.Krzeszowice III 4:1<br>\r\nKlasyfikacja końcowa:<br>\r\nGim.Zalas 10 pkt<br>\r\nSP Krzeszowice 8pkt<br>\r\nGim. Krzeszowice I 6pkt<br>\r\nGim. Krzeszowice II 4pkt<br>\r\nGim. Krzeszowice III 0pkt<br>\r\nW turnieju halowej piłki nożnej wystąpiło 6 zespołów : Gimnazjum Zalas \r\noraz 3 drużyny z rocznika 1995 i 2 drużyny z rocznika 1996 z Gimnazjum w Krzeszowicach.<br>\r\nDrużyny były podzielone na 2 grupy po 3 zespoły<br>\r\nI grupa<br>\r\nII BE : I C 2:0<br>\r\nI C : II A 6:1<br>\r\nII BE : II A 4:0<br>\r\nII grupa <br>\r\nII C : Zalas 4:2<br>\r\nZalas : I F 4:2<br>\r\nII C : I F 7:2<br>\r\nMecz o 5 miejsce <br>\r\nI C : I F 3:3 k.5:3<br>\r\nMecz o 3 miejsce <br>\r\nZalas : II A 3:0<br>\r\nFinał <br>\r\nII BE : II C 2:5<br>\r\nW turnieju piłki siatkowej dziewcząt wystąpiło 6 zespołów z\r\nkrzeszowickiego Gimnazjum. Drużyny grały systemem każdy z każdym.<br>\r\nKlasyfikacja końcowa :<br>\r\n1.Muszynianka Krzeszowice<br>\r\n2.Dream Team<br>\r\n3.Spice Girls<br>\r\n4.Nr.1 Team<br>\r\n5.Volleyball Team<br>\r\n6.Smerfetki<br>\r\n\r\nW turnieju piłki koszykowej wystąpiły 4 zespoły, które grały systemem każdy z każdym.\r\nWyniki meczów : <br>\r\nUrbanek Team : Kłeczek and Company 24:13<br>\r\nLenartowicz & Koledzy : Mastalerz and warriors 14:12<br>\r\nLenartowicz : Urbanek 13:24<br>\r\nKłeczek : Mastalerz 23:13<br>\r\nLenartowicz : Kłeczek 19:44<br>\r\nMastalerz : Urbanek 16:27<br>\r\nKlasyfikacja końcowa :<br>\r\n1.Urbanek Team<br>\r\n2.Kłeczek and Company<br>\r\n3.Lenartowiczi koledzy<br>\r\n4.Mastalerz and warriors<br>\r\n<br>\r\nBlok imprez rekreacyjnych obejmował :<br>\r\n-Świat zabaw dla dzieci<br>\r\n- zamek dmuchany<br>\r\n- zjeżdzalnie<br>\r\n- euro bungee<br>\r\n- paint ball<br>\r\n- quady<br>\r\n- przejażdżka samochodami terenowymi<br>\r\n- szereg konkurencji i zabaw dla dzieci z licznymi nagrodami za udział<br>\r\n- bezpłatne lody dla dzieci<br>\r\n- bezpłatna herbata i kawa dla opiekunów<br>\r\n- kampania edukacyjno-profilaktyczna "Zachowajtrzeźwy umysł", podczas której dzieci otrzymały bardzo dużo nagród,\r\nsłodyczy i napojów zorganizowanej przez pełnomocnika Burmistrza do spraw\r\nprofilaktyki i uzależnień p. Nine Kurdziel<br>\r\n- bieg na orientację zorganizowany przez Komendę Hufca w Krzeszowicach<br>\r\nWszystkie tak słodkie i wspaniałe atrakcje były możliwe dzięki pomocy naszych wspaniałych sponsorów.\r\nBlok imprez rekreacyjno-sportowych zorganizowany został w ramach zadania własnego\r\nprzy wsparciu finansowym gminy.<br><b><i>Sponsorzy\r\nDnia Dziecka:KW Czatkowice,Kopalnie Porfiru\r\ni Diabazu,Ambasador-Szkoła Języków Obcych, Bostar, Chemmark,\r\nElektrosystem\r\nMatysik Michał,Elwast- Sklep i Usługi Elektryczne J. Walczowski, Gleń\r\n-Ryś\r\nElektronarzędzia,Hydro-instal Technika Grzewcza i Sanitarna Witold\r\nMikołajski,\r\nInstalterm-Systemy Grzewcze A.Życki,FH.Kramarczyk Wypożyczalnia Sprzętu\r\nBudowlanego,Kris-Pol profesjonalne układanie kostki brukowej Krzysztof\r\nCzerwonka, Larix Producent Mebli Wojciech Mikołajski, Melba,PHU. Olmar\r\nJ.Maj,B.Maj sp.j.Parkiet Urbanik,Sklep Mięsny Tarnowski ,Podstawowa Stacja Diagnostyki Pojazdów Piotr Hrabia </i></b>', NULL, NULL),
	(23, 'Turnieje młodzieżowe 2010', 'turnieje-mlodziezowe-2010', '﻿Uczniowski Klub Sportowy "Jedynka" organizował od września\r\ndo grudnia cykl turniejów halowej piłki nożnej dla młodzieży w ramach\r\njubileuszu 10-lecia swego istnienia. W turnieju wzięły udział następujące\r\ndrużyny : TS Tsunami, GKS Krzeszo, The Generation, Poziomki, FC II D, FC\r\nGalacticos, Ludzie Chudego, FC Tenczynek, GKS Tenczynek, FC Nowa Góra, The Red\r\nDevils, FC Czatkowice, FC Krzeszowice, FC Street.\r\n<br><br>\r\nPunktacja na zakończenie turnieju przedstawia się\r\nnastępująco:\r\n<br>\r\n 1.TS Tsunami  34 pkt\r\n<br>\r\n 2.The Generation   29 pkt\r\n<br>\r\n 3.GKS\r\nKrzeszo 26 pkt\r\n<br>\r\n 4.Ludzie Chudego 17 pkt\r\n<br>\r\n 5.Red Devils  13 pkt \r\n<br>\r\n 6.Nowa Góra 12 pkt\r\n<br>\r\n 7.FC Tenczynek 9 pkt\r\n<br>\r\n FC II D   9\r\npkt<br>\r\n\r\n GKS Tenczynek 9 pkt\r\n<br>\r\n10.FC Krzeszowice 8\r\npkt\r\n<br>\r\n11. Galacticos  7\r\npkt\r\n<br>\r\n12.FC Czatkowice 6\r\npkt\r\n<br>\r\n Poziomki\r\n6 pkt\r\n<br><br>\r\nNajlepsi strzelcy : \r\n<br>\r\nBrzuchacz Mateusz (The Generation) 24\r\n<br>\r\nSkawiński Dawid (TS Tsunami) 24\r\n<br>\r\nKaczmarczyk Kamil (TS Tsunami) 19\r\n<br>\r\nWszyscy uczestnicy turnieju otrzymali napoje, słodycze oraz\r\nowoce a najlepsi otrzymali dyplomy, puchary i statuetki oraz pamiątkowe\r\nkoszulki. Cały cykl turniejów organizowany był przez UKS "Jedynka" w ramach\r\nzadania publicznego "Organizowanie imprez sportowo-rekreacyjnych". W turnieju\r\nwzięło udział ok. 120 osób. Cztery najlepsze drużyny z naszego turnieju wezmą\r\nudział w turnieju międzygminnym drużyn amatorskich, który odbędzie się w lutym. Zdjęcia z turnieju można znaleźć<a href="zdjecia_turnieje_mlodziezowe.php">tutaj</a>', NULL, NULL),
