	(26, 'Turniej juniorów młodszych - styczeń 2011', 'turniej-juniorow-mlodszych-styczen-2011', '<p>15 stycznia na hali w Krzeszowicach został rozegrany turniej\r\nhalowej piłki nożnej dla młodzieży rocznik 1993 i młodsi. W turnieju wzięło udział 6 drużyn : Orzeł\r\nBalin, Orły Chrzanów, Świt Krzeszowice, Północ Chrzanów, Antalya oraz\r\ngospodarze UKS Kramarczyk Jedynka.</p>\r\n\r\nOto wyniki:<br>\r\nGrupa I<br>\r\nOrzeł Balin : Antalya 2:3<br>\r\nUKS Kramarczyk : Antalya 4:1<br>\r\nUKS Kramarczyk : Orzeł Balin 4:0<br>\r\nGrupa II<br>\r\nPółnoc Chrzanów : Orły Chrzanów 1:0<br>\r\nŚwit Krzeszowice : Orły Chrzanów 4:1<br>\r\nŚwit Krzeszowice : Północ Chrzanów 5:0<br>\r\nPółfinały<br>\r\nUKS Kramarczyk : Północ Chrzanów 1:2<br>\r\nŚwit Krzeszowice : Antalya 0:3<br>\r\nMecz o 3 miejsce<br>\r\nŚwit Krzeszowice : UKS Kramarczyk 3:9<br>\r\nFinał <br>\r\nAntalya : Północ Chrzanów 1:1 k. 4:3<br>\r\nKlasyfikacja końcowa<br>\r\n1.Antalya<br>\r\n2.Północ Chrzanów<br>\r\n3.UKS Kramarczyk Jedynka<br>\r\n4.Świt Krzeszowice<br>\r\n5.Orły Chrzanów<br>\r\n6.Orzeł Balin<br>\r\nKrólem strzelców został Paweł Wąchol(UKS Kramarczyk Jedynka), najlepszym\r\nzawodnikiem wybrano Michała Kaisera z Północy Chrzanów a najlepszym\r\nbramkarzem został Konrad Kosek z Antalya\'i', NULL, NULL),
	(27, 'Turniej oldbojów i zakładów pracy - styczeń 2011', 'turniej-oldbojow-i-zakladow-pracy-styczen-2011', '16 stycznia na hali w Krzeszowicach został rozegrany turniej\r\nhalowej piłki nożnej oldbojów i zakładów pracy. W\r\nturnieju wzięło udział 6 drużyn : KW Czatkowice, Kaprin, Gazownicy\r\nKrakowscy, PPN Chrzanów, Taras oraz gospodarze Oldboje Pyszne\r\nKrzeszowice. Mecze grano systemem każdy z każdym.Oto wyniki: Pyszne : Taras 6:1<br>KW Czatkowice : Kaprin 5:1<br>Pyszne : Gazownicy 3:2<br>Taras : KW Czatkowice 2:4<br>PPN Chrzanów : Kaprin 4:0<br>KW Czatkowice : Pyszne 6:4<br>PPN Chrzanów : Gazownicy 2:3<br>Kaprin : Taras 2:1<br>PPN Chrzanów : KW Czatkowice 2:3<br>Pyszne : Kaprin 3:2<br>Gazownicy&nbsp; : Taras 1:3<br>Pyszne : PPN Chrzanów 2:6<br>KW Czatkowice : Gazownicy 3:5<br>PPN Chrzanów : Taras 6:2<br>Gazownicy : Kaprin 5:0<br><br>Klasyfikacja końcowa :<br>1. KW Czatkowice<br>2.Gazownicy Krakowscy<br>3.PPN Chrzanów<br>4. Oldboje Pyszne Krzeszowice<br>5.Kaprin<br>6.Taras<br>Królem\r\nstrzelców został Radosław Klimek(PPN Crzhanów), najlepszym\r\nzawodnikiem wybrano Arkadiusza Okręglickiego z KW Czatkowice a najlepszym\r\nbramkarzem został Ireneusz Młynarczyk(Oldboje Pyszne Krzeszowice)\r\n', NULL, NULL),
	(28, 'Turniej oldbojów - marzec 2011', 'turniej-oldbojow-marzec-2011', '12 marca 2011 na hali w Krzeszowicach odbył się II turniej oldbojów i zakładów pracy.<br>\r\nOto wyniki : <br>\r\nOldboje Pyszne Krzeszowice : Bostar 4:3<br>\r\nGazownicy Krakowscy : Manhattan Trzebinia 3:6<br>\r\nBostar : KW Czatkowice 0:6<br>\r\nPyszne : Manhattan 1:5<br>\r\nGazownicy : KW Czatkowice 2:5<br>\r\nBostar : Manhattan 1:3<br>\r\nGazownicy : Pyszne 5:6<br>\r\nManhattan : KW Czatkowice 2:6<br>\r\nBostar : Gazownicy 2:2<br>\r\nPyszne : KW Czatkowice 6:4<br><br>\r\nKlasyfikacja końcowa <br>\r\n1. KW Czatkowice<br>\r\n2.Manhattan Trzebinia<br>\r\n3.Oldboje Pyszne Krzeszowice<br>\r\n4.Gazownicy Krakowscy<br>\r\n5.Bostar<br><br>\r\nNajlepszy strzelec : Jawień Piotr (Pyszne)<br>\r\nNajlepszy bramkarz : Wójcik Rafał (KW Czatkowice)<br>\r\nNajlepszy zawodnik : Stojewski Piotr (Manhattan Trzebinia)<br>\r\n', NULL, NULL),
