	(30, 'Turniej miast II', 'turniej-miast-ii', '7 marca rozegrano na hali w Krzeszowicach turniej\r\nfutsalowy pomiędzy\r\nprzedstawicielami regionalnych lig z Krzeszowic i Chrzanowa. Oto wyniki\r\n:<br>\r\n<br>\r\nI grupa<br>\r\nUKS I : Mati 1:2<br>\r\nProtector : Wygiełzów 1:1<br>\r\nUKS I : Protector 3:4<br>\r\nMati : Wygiełzów 3:3<br>\r\nUKS I : Wygiełzów 5:5<br>\r\nMati : Protector 5:5<br>\r\n<br>\r\nII grupa<br>\r\nAdi : UKS II 3:3<br>\r\nMegalo : Antayla 1:0<br>\r\nAntayla : UKS II 3:2<br>\r\nMegalo : Adi 2:5<br>\r\nMegalo : UKS II 5:0<br>\r\nAdi : Antayla 3:3<br>\r\n<br>\r\nPółfinały : <br>\r\nAdi : Protector 2:5<br>\r\nMegalo : Wygiełzów 3:2 <br>\r\n<br>\r\nMecz o 3 miejsce : <br>\r\nWygiełzów : Adi 10:4<br>\r\n<br>\r\nFinał :<br>\r\nProtector : Megalo 1:2<br>\r\n<br>\r\nKlasyfikacja końcowa : <br>\r\n1.Megalo<br>\r\n2.Protector<br>\r\n3.Wygiełzów<br>\r\n4.Adi<br>\r\n5.Mati<br>\r\n6.Antayla<br>\r\n7.UKS I<br>\r\n8.UKS II<br>\r\n<br>\r\nKrólem strzelców został Łukasz Grabowski z Wygiełzowa a najlepszym\r\nbramkarzem wybrano Marcina Domurata z Megalo.<br>\r\nTurniej\r\nprzyciągnął sporą grupę kibiców na trybuny a organizatorzy\r\nmają\r\nnadzieję na wpisanie go na stałę do futsalowego kalendarza naszego\r\nregionu.<br>\r\n<br>', NULL, NULL),
	(31, 'Turniej juniorów młodszych Świt Cup - luty 2011', 'turniej-juniorow-mlodszych-swit-cup-luty-2011', '10 lutego 2011 na hali w Krzeszowicach odbyła się 1 edycja turnieju\r\njuniorów młodszych "Świt Cup" . W turnieju wzięło udział 7 drużyn :\r\nOlimpic Kraków, Kmita Zabierzów, Wolanka Wola Filipowska, Orzeł Balin,\r\n2 zespoły Karpat Siepraw oraz gospodarze Świt Krzeszowice. Na turniej\r\nnie dojechała drużyna Borku Kraków&nbsp;<br>Oto wyniki :&nbsp;<br>Grupa I&nbsp;<br>Świt : Wolanka 8:1&nbsp;<br>Olimpic : Karpaty II 1:3&nbsp;<br>Świt : Karpaty II 2:0&nbsp;<br>Olimpic : Wolanka 1:3&nbsp;<br>Świt : Olimpic 7:1&nbsp;<br>Karpaty II : Wolanka 2:2&nbsp;<br>Grupa II&nbsp;<br>Karpaty I : Kmita 2:1&nbsp;<br>Orzeł : Karpaty I 0:1&nbsp;<br>Kmita : Orzeł 0:2&nbsp;<br>Mecze o miejsca 5-7&nbsp;<br>Kmita : Wolanka 9:0&nbsp;<br>Wolanka : Olimpic 3:1&nbsp;<br>Kmita : Olimpic 3:4&nbsp;<br>Półfinały&nbsp;<br>Świt : Orzeł 2:3&nbsp;<br>Karpaty I : Karpaty II 2:2 k.2:1&nbsp;<br>Mecz o 3 miejsce&nbsp;<br>Świt : Karpaty II 4:2&nbsp;<br>Finał&nbsp;<br>Karpaty I : Orzeł 2:0&nbsp;<br>Klasyfikacja ko&#324;cowa&nbsp;<br>1.Karpaty Siepraw I&nbsp;<br>2. Orzeł Balin&nbsp;<br>3. Świt Krzeszowice&nbsp;<br>4. Karpaty Siepraw II&nbsp;<br>5.Kmita Zabierzów&nbsp;<br>6.Olimpic Kraków&nbsp;<br>7.Wolanka Wola Filipowska&nbsp;<br>Najlepszym\r\nzawodnikiem turnieju został Grzegorz Juszczak (Karpaty I), najlepszym\r\nstrzelcem zostali Paweł Wąchol i Daniel Haber (obaj Świt Krzeszowice) z\r\n6 bramkami a najlepszym bramkarzem wybrano Dawida Skoczylasa z Orła\r\nBalin.</span><br><br>Patronat medialny nad turniejem objęły redakcje <span style="font-style: italic;">Dziennika Polskiego</span> oraz <span style="font-style: italic;">Futbol Małopolska</span><br>', NULL, NULL),
	(32, 'Turniej oldbojów 2012', 'turniej-oldbojow-2012', '10 marca na hali w Krzeszowicach został rozegrany turniej halowej piłki noznej oldbojów. W turnieju najlepsza okazała się drużyna Manhattan Trzebinia, przed gospodarzami Pyszne Krzeszowice oraz drużyną Beskidu Andrychów.<br>\r\n<br> Najlepszym strzelcem turnieju został Wiesław Fryda (Pyszne Krzeszowice) z dorobkiem 7 bramek, najlepszym zawodnikiem wybrany został Piotr Stojewski ze zwycięskiej drużyny a najlepszym bramkarzem Piotr Żydek(Beskid Andrychów)<br>\r\n<br>\r\nWyniki turnieju:<br>\r\nKW Czatkowice : Pyszne Krzeszowice 1:1<br>\r\nManhattan Trzebinia : Regulice 1:0<br>\r\nArcelor Mittal : Beskid Andrychów 1:1<br>\r\nPyszne : Regulice 2:2<br>\r\nCzatkowice : Beskid 0:3<br>\r\nManhattan : Arcelor 4:0<br>\r\nRegulice : Beskid 0:0<br>\r\nPyszne : Manhattan 2:4<br>\r\nCzatkowice : Arcelor 4:1<br>\r\nPyszne : Beskid 2:1<br>\r\nRegulice : Arcelor 0:1<br>\r\nCzatkowice : Manhattan 1:1<br>\r\nBeskid : Manhattan \r\nPyszne : Arcelor 4:3<br>\r\nBeskid : Manhattan 3:3<br>\r\nBeskid : Arcelor 1:1<br>\r\n\r\n<br>\r\nKlasyfikacja końcowa: <br>\r\n1.Manhattan Trzebinia <br>\r\n2.Pyszne Krzeszowice <br>\r\n3.Beskid Andrychów <br>\r\n4.Regulice <br>\r\n5.KW Czatkowice <br>\r\n6.Arcelor Mittal <br>', NULL, NULL),
	(33, 'Halowe mistrzostwa Krzeszowic 2012', 'halowe-mistrzostwa-krzeszowic-2012', '12 lutego na hali w Krzeszowicach odbyły się mistrzostwa Gminy Krzeszowice w halowej piłce nożnej organizowane przez UKS Jedynka oraz CKIS Krzeszowice. Drużyny składały się z mieszkańców poszczególnych miejscowości naszej gminy. W turnieju wzięło udział 5 drużyn : FIlipowice, Wola Filipowska, Krzeszowice, Tenczynek i Nawojowa Góra. Oto wyniki:\r\n<br><br>\r\nWola Filipowska : Nawojowa Góra 3:7 <br>\r\nKrzeszowice : Tenczynek 4:3 <br>\r\nNawojowa Góra : Krzeszowice 2:11 <br>\r\nFilipowice : Wola Filipowska 2:2 <br>\r\nKrzeszowice : Filipowice 4:3 <br>\r\nTenczynek : Nawojowa Góra 3:4 <br>\r\nFilipowice : Tenczynek 10:1 <br>\r\nWola Filipowska : Krzeszowice 1:2 <br>\r\nTenczynek : Wola Filipowska 2:5 <br>\r\nNawojowa Góra : Filipowice 3:1 <br>\r\n<br>\r\nKońcowa kolejność : <br>\r\n1. Krzeszowice 12pkt<br>\r\n2. Nawojowa Góra 9pkt<br>\r\n3. Filipowice 4pkt<br>\r\n4. Wola Filipowska 4pkt<br>\r\n5. Tenczynek 0pkt <br>\r\n<br>\r\nNajlepszy bramkarz : Kamil Kłosowski (Krzeszowice)<br>\r\nNajlepszy zawodnik : Mateusz Marszałek (Nawojowa Góra) <br>\r\nNajlepszy strzelec : Łukasz Nowak (Filipowice) <br>\r\n<br>\r\nSkłady drużyn <br>\r\nKrzeszowice : Kłosowski Kamil, Zimoląg Andrzej, Deryniowski Piotr, Funek Adrian, Mroziński Daniel <br>\r\nNawojowa Góra : Wróbel Tomasz, Marszałek Mateusz, Mucha Artur, Nawała Bartosz, Marszałek Jakub, Kisielak Jacek <br>\r\nWola Filipowska : Dudek Artur, Pałka Wojciech, Ślusarczyk Dominik, Ślusarczyk Mariusz, Kempka Dawid, Warzecha Jakub, Motyl Robert, Starzykiewicz Marcin <br>\r\nTenczynek : Pałka Przemysław, Czak Krzysztof, Izdebski Michał, Ślusarczyk Krzysztof, Kościółek Kamil, Kot Jarosław, Jawień Piotr, Sudoł Robert, Strzeboński Krzysztof <br>\r\nFilipowice : Dorynek Marcin, Kłeczek Mateusz, Filipek Mateusz, Święszek Bartłomiej, Grochal Łukasz, Skotniczny Łukasz, Kalęba Daniel, Ciombor Mateusz, Nowak Łukasz, Pałka Tomasz <br>', NULL, NULL),
	(34, 'Międzynarodowy Turniej Futsalu Dziewcząt U99 - 2014', 'miedzynarodowy-turniej-futsalu-dziewczat-u99-2014', '<p>W dniach 29-30.11.2014 w Krzeszowicach rozegrany został Międzynarodowy Mikołajkowy turniej futsalu dziewcząt z rocznika 1999 i młodszych. W turnieju wzięło udział 12 drużyn w tym 3 ze Słowacji. Turniej zakończył się zwycięstwem drużyny Bronowianki I przed Naprzodem Sobolów i drużyną MFK Rużemberok I. Najlepszą zawodniczką turnieju została Michaela Buzakova(MFK Rużemberok I), najlepszą bramkarką uznano Klaudie Kurek z Naprzodu Sobolów a najlepszą strzelczynią została Wiktoria Pietrzyk z Bronowianki I</p>\r\n<p>Oto komplet wyników:</p>\r\n<p><strong>Faza grupowa</strong></p>\r\n<p> </p>\r\n<p>Grupa 1</p>\r\n<p>UKS Jedynka Krzeszowice II : Bronowianka Kraków I 1:13</p>\r\n<p>Victoria Gaj : Orawa Team 2:3</p>\r\n<p>Orawa Team : Bronowianka I 1:2</p>\r\n<p>Victoria : UKS Jedynka II 7:0</p>\r\n<p>Bronowianka I : Victoria 9:3</p>\r\n<p>Orawa Team : UKS Jedynka II 6:2</p>\r\n<p> </p>\r\n<p>Grupa 2</p>\r\n<p>MFK Rużemberok I : AS Progres 7:0</p>\r\n<p>LKS Promyk Bolęcin : UKS Jedynka I 4:2</p>\r\n<p>Promyk : Rużemberok I 0:1</p>\r\n<p>UKS Jedynka I : As Progres 4:0</p>\r\n<p>As Progres : Promyk 3:2</p>\r\n<p>UKS Jedynka I : Rużemberok I 1:0</p>\r\n<p>Grupa 3</p>\r\n<p>MFK Rużemberok II : Naprzód Sobolów 0:4</p>\r\n<p>Bronowianka Kraków II : Prądniczanka 1:2</p>\r\n<p>Bronowianka II : Rużemberok II 6:0</p>\r\n<p>Prądniczanka : Naprzód 0:4</p>\r\n<p>Naprzód : Bronowianka II 1:1</p>\r\n<p>Prądniczanka : Rużemberok II 4:0</p>\r\n<p> </p>\r\n<p><strong>Faza finałowa</strong></p>\r\n<p> </p>\r\n<p>Grupa o miejsca 9-12</p>\r\n<p>Orawa Team : UKS Jedynka II 6:2</p>\r\n<p>UKS Jedynka II : AS Progres 3:5</p>\r\n<p>LKS Promyk Bolęcin : MFK Rużemberok I 1:0</p>\r\n<p>UKS Jedynka II :  Promyk 0:1</p>\r\n<p>Progres : Rużemberok I 1:2</p>\r\n<p>UKS Jedynka II :  Rużemberok I 0:1</p>\r\n<p>AS Progres : Promyk 1:2</p>\r\n<p> </p>\r\n<p>Grupa o miejsca 5-8</p>\r\n<p>Victoria Gaj : Prądniczanka Kraków 5:0</p>\r\n<p>Orawa Team : Bronowianka Kraków II 3:0</p>\r\n<p>Victoria : Orawa Team 2:4</p>\r\n<p>Prądniczanka : Bronowianka II 3:2</p>\r\n<p>Victoria Gaj : Bronowianka II 7:3</p>\r\n<p>Prądniczanka : Orawa Team 0:3</p>\r\n<p> </p>\r\n<p>Grupa o miejsca 1-4</p>\r\n<p>UKS Jedynka I : MFK Rużemberok I 0:2</p>\r\n<p>Bronowianka I :  Naprzód 3:2</p>\r\n<p>UKS Jedynka I : Bronowianka 0:7</p>\r\n<p>Rużemberok I : Naprzód 1:2</p>\r\n<p>UKS Jedynka I : Naprzód 1:3</p>\r\n<p>Rużemberok I : Bronowianka I 1:1</p>\r\n<p> </p>\r\n<p>Końcowa kolejność</p>\r\n<p>1. Bronowianka Kraków I</p>\r\n<p>2. Naprzód Sobolów</p>\r\n<p>3. MFK Rużemberok I</p>\r\n<p>4. UKS Jedynka Krzeszowice</p>\r\n<p>5. Orawa Team</p>\r\n<p>6. Victoria Gaj</p>\r\n<p>7. Prądniczanka Kraków</p>\r\n<p>8. Bronowianka Kraków II</p>\r\n<p>9. LKS Promyk Bolęcin</p>\r\n<p>10. MFK Rużemberok II</p>\r\n<p>11. AS Progres</p>\r\n<p>12. UKS Jedynka II</p>\r\n<p><strong> </strong></p>\r\n<p> </p>', NULL, NULL);
